pie, ME, 2004-08-10 16:59:18\")\n	(author [GK_73681])\n	(dateTime \"2004-08-10 16:59:18\")\n	(DB_ID 139957))\n\n([GK_139958] of  Summation\n\n	(_displayName \"The death receptors, all cell-surface receptors, begin the p...\")\n	(DB_ID 139958)\n	(text \"The death receptors, all cell-surface receptors, begin the process of caspase activation. The common feature of these type 1 transmembrane proteins is the \\\"death-domain\\\" a conserved cytoplasmic motif found on all of the three receptors (FAS/CD95, TNF-receptor, and TRAIL-receptor) that binds the Fas-associated protein with death domain (FADD). Ligand binding to death receptors (DR) results in receptor oligomerization and recruitment of adaptor proteins via homophilic interaction of death domains. This project describes an assembly of the death-inducing signaling complex (DISC) and shows protein composition and stoichiometry within the DISC. It also provides the appropriate literature references if available. However, the DISC signaling complex may vary in its components stoichiometry. DR signaling may trigger formation of higher order receptor structures or signaling through rearrangement of receptor chains, which is not reflected here.\"))\n\n([GK_139959] of  Summation\n\n	(_displayName \"Known as the \\\"death receptor pathway\\\" the extrinsic or caspa...\")\n	(DB_ID 139959)\n	(text \"Known as the \\\"death receptor pathway\\\" the extrinsic or caspase 8/10 dependent pathway is activated by ligand binding. The \\\"death receptors\\\" are specialized cell-surface receptors including Fas/CD95, tumor necrosis factor-alpha (TNF-alpha) receptor 1, and two receptors, DR4 and DR5, that bind to the TNF-alpha related apoptosis-inducing ligand (TRAIL). The extrinsic and intrinsic pathways unite in the activation of Caspase-3, though the two pathways communicate through the pro-apoptotic Bcl-2 family member Bid before uniting at the shared activation of Caspase-3.\"))\n\n([GK_139960] of  LiteratureReference\n\n	(_displayName \"The biochemistry of apoptosis.\")\n	(author [GK_140492])\n	(DB_ID 139960)\n	(journal \"Nature\")\n	(pages \"770-6\")\n	(pubMedIdentifier 11048727)\n	(title \"The biochemistry of apoptosis.\")\n	(volume 407)\n	(year 2000))\n\n([GK_140] of  GO_BiologicalProcess\n\n	(_displayName \"cell surface receptor signaling pathway\")\n	(accession \"0007166\")\n	(DB_ID 140)\n	(definition \"A series of molecular signals initiated by activation of a receptor on the surface of a cell. The pathway begins with binding of an extracellular ligand to a cell surface receptor, or for receptors that signal in the absence of a ligand, by ligand-withdrawal or the activity of a constitutively active receptor. The pathway ends with regulation of a downstream cellular process, e.g. transcription.\")\n	(instanceOf [GK_141])\n	(name \"cell surface receptor signaling pathway\")\n	(referenceDatabase [GK_1]))\n\n([GK_140480] of  InstanceEdit\n\n	(_displayName \"Gillespie, ME, 2004-08-18 21:05:31\")\n	(author [GK_73681])\n	(dateTime \"2004-08-18 21:05:31\")\n	(DB_ID 140480))\n\n([GK_140481] of  Summation\n\n	(_displayName \"The Fas family of cell surface receptors initiate the apotot...\")\n	(DB_ID 140481)\n	(literatureReference\n		[GK_140482]\n		[GK_140484]\n		[GK_140483])\n	(text \"The Fas family of cell surface receptors initiate the apototic pathway through interaction with the external ligand, FasL.  The cytoplasmic domain of Fas interacts with a number of molecules in the transduction of the external signal to the cytoplasmic side of the cell membrane. The most notable cytoplasmic domain is the Death Domain (DD) that is involved in recruiting the FAS-associating death domain-containing protein (FADD). This interaction drives downstream events.\"))\n\n([GK_140482] of  LiteratureReference\n\n	(_displayName \"The polypeptide encoded by the cDNA for human cell surface antigen Fas can mediate apoptosis\")\n	(author\n		[GK_141169]\n		[GK_141174]\n		[GK_141175]\n		[GK_141172]\n		[GK_141170]\n		[