K_140979] of  LiteratureReference\n\n	(_displayName \"Induction of TNF receptor I-mediated apoptosis via two sequential signaling complexes\")\n	(author\n		[GK_140975]\n		[GK_77293])\n	(DB_ID 140979)\n	(journal \"Cell\")\n	(pages \"181-90\")\n	(pubMedIdentifier 12887920)\n	(title \"Induction of TNF receptor I-mediated apoptosis via two sequential signaling complexes\")\n	(volume 114)\n	(year 2003))\n\n([GK_140991] of  Person\n\n	(_displayName \"Wang, S\")\n	(DB_ID 140991)\n	(initial \"S\")\n	(surname \"Wang\"))\n\n([GK_140992] of  LiteratureReference\n\n	(_displayName \"TRAIL and apoptosis induction by TNF-family death receptors\")\n	(author\n		[GK_140991]\n		[GK_77151])\n	(DB_ID 140992)\n	(journal \"Oncogene\")\n	(pages \"8628-33\")\n	(pubMedIdentifier 14634624)\n	(title \"TRAIL and apoptosis induction by TNF-family death receptors\")\n	(volume 22)\n	(year 2003))\n\n([GK_141] of  GO_BiologicalProcess\n\n	(_displayName \"signal transduction\")\n	(accession \"0007165\")\n	(componentOf\n		[GK_142]\n		[GK_2587988])\n	(DB_ID 141)\n	(definition \"The cellular process in which a signal is conveyed to trigger a change in the activity or state of a cell. Signal transduction begins with reception of a signal (e.g. a ligand binding to a receptor or receptor activation by a stimulus such as light), or for signal transduction in the absence of ligand, signal-withdrawal or the activity of a constitutively active receptor. Signal transduction ends with regulation of a downstream cellular process, e.g. regulation of transcription or regulation of a metabolic process. Signal transduction covers signaling from receptors located on the surface of the cell and signaling via molecules located within the cell. For signaling between cells, signal transduction is restricted to events at and within the receiving cell.\")\n	(instanceOf\n		[GK_139809]\n		[GK_171571])\n	(name \"signal transduction\")\n	(referenceDatabase [GK_1]))\n\n([GK_141075] of  Person\n\n	(_displayName \"Ashkenazi, A\")\n	(DB_ID 141075)\n	(initial \"A\")\n	(surname \"Ashkenazi\"))\n\n([GK_141083] of  Summation\n\n	(_displayName \"Tumor necrosis factor-related apoptosis-inducing ligand or A...\")\n	(DB_ID 141083)\n	(literatureReference\n		[GK_140992]\n		[GK_3371373]\n		[GK_141314])\n	(text \"Tumor necrosis factor-related apoptosis-inducing ligand or Apo 2 ligand (TRAIL/Apo2L) is a member of the tumor necrosis factor (TNF) family. This group of apoptosis induction pathways all work through protein interactions mediated by the intracellular death domain (DD), encoded within the cytoplasmic domain of the receptor. TRAIL selectively induces apoptosis through its interaction with the Fas-associated death domain protein (FADD) and caspase-8/10 (Wang S & el-Deiry WS 2003; Sprick MR et al. 2002). TRAIL and its receptors, TRAIL-R1 and TRAIL-R2, were shown to be rapidly endocytosed via clathrin-dependent and -independent manner in human Burkitt\'s lymphoma B cells (BJAB) (Kohlhaas SL et al. 2007). However, FADD and caspase-8 were able to bind TRAIL-R1/R2 in TRAIL-stimulated BJAB cells at 4<sup>o</sup>C (at which membrane trafficking is inhibited), suggesting that the endocytosis was not required for an assembly of the functional TRAIL DISC complex. Moreover, blocking of clathrin-dependent endocytosis did not interfere with the capacity of TRAIL to promote apoptosis (Kohlhaas SL et al. 2007).<br>\"))\n\n([GK_141084] of  InstanceEdit\n\n	(_displayName \"Gillespie, ME, 2004-08-31 03:31:31\")\n	(author [GK_73681])\n	(dateTime \"2004-08-31 03:31:31\")\n	(DB_ID 141084))\n\n([GK_141118] of  Complex\n\n	(_displayName \"[Hsa] TRAIL receptor-2:TRAIL complex [plasma membrane]\")\n	(compartment [GK_876])\n	(DB_ID 141118)\n	(hasComponent\n		[GK_65505]\n		[GK_66186])\n	(name \"TRAIL receptor-2:TRAIL complex\")\n	(species [GK_48887])\n	(stableIdentifier [GK_368665]))\n\n([GK_141126] of  Complex\n\n	(_displayName \"[Hsa] TRAIL receptor-2:TRAIL Trimer [plasma membrane]\")\n	(compartment [GK_876])\n	(DB_ID 141