s. Also detected in diverse cell lines. Isoform 8 is predominantly expressed in testis and skeletal muscle.INDUCTION Repressed by IL2/interleukin-2 after TCR stimulation, during progression to the S phase of the cell cycle.DOMAIN The caspase domain lacks the active sites residues involved in catalysis.PTM Proteolytically processed; probably by caspase-8. Processing likely occurs at the DISC and generates subunit p43 and p12.SIMILARITY Belongs to the peptidase C14A family.SIMILARITY Contains 2 DED (death effector) domains.\")\n	(DB_ID 145326)\n	(description \"recommendedName: CASP8 and FADD-like apoptosis regulator  alternativeName: Caspase homolog shortName:CASH  alternativeName: Caspase-eight-related protein shortName:Casper  alternativeName: Caspase-like apoptosis regulatory protein shortName:CLARP  alternativeName: Cellular FLICE-like inhibitory protein shortName:c-FLIP  alternativeName: FADD-like antiapoptotic molecule 1 shortName:FLAME-1  alternativeName: Inhibitor of FLICE shortName:I-FLICE  alternativeName: MACH-related inducer of toxicity shortName:MRIT  alternativeName: Usurpin  component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p43  /component component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p12  /component\")\n	(geneName\n		\"CFLAR\"\n		\"CASH\"\n		\"CASP8AP1\"\n		\"CLARP\"\n		\"MRIT\")\n	(identifier \"O15519\")\n	(isoformParent [GK_51926])\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Apoptosis\"\n		\"Complete proteome\"\n		\"Host-virus interaction\"\n		\"Polymorphism\"\n		\"Reference proteome\"\n		\"Repeat\")\n	(name \"CFLAR\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"CFLAR_HUMAN\"\n		\"B4DJE0\"\n		\"B7Z9F9\"\n		\"O14673\"\n		\"O14674\"\n		\"O14675\"\n		\"O15137\"\n		\"O15138\"\n		\"O15356\"\n		\"O15510\"\n		\"O43618\"\n		\"O43619\"\n		\"O43620\"\n		\"O60458\"\n		\"O60459\"\n		\"Q53TS6\"\n		\"Q54AF1\"\n		\"Q96TE4\"\n		\"Q9UEW1\")\n	(sequenceLe