0; Oberst A et al 2010].\"))\n\n([GK_213104] of  Summation\n\n	(_displayName \"Procaspase-8 monomers undergo dimerization. The dimerization...\")\n	(DB_ID 213104)\n	(text \"Procaspase-8 monomers undergo dimerization. The dimerization event occurs at death-inducing signaling complex (DISC) and results in a reposition of the procaspase-8 inter-subunit linker to become accessible for intermolecular processing by the associated procaspase-8 molecule [Keller N et al 2010; Oberst A et al 2010].\"))\n\n([GK_2132740] of  GO_BiologicalProcess\n\n	(_displayName \"signal transduction in absence of ligand\")\n	(accession \"0038034\")\n	(DB_ID 2132740)\n	(definition \"A series of molecular signals initiated by the absence of a ligand or the withdrawal of a ligand from a receptor.\")\n	(instanceOf [GK_141])\n	(name \"signal transduction in absence of ligand\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133460] of  GO_MolecularFunction\n\n	(_displayName \"cysteine-type endopeptidase activity involved in apoptotic process\")\n	(accession \"0097153\")\n	(componentOf [GK_2273])\n	(DB_ID 2133460)\n	(definition \"Catalysis of the hydrolysis of internal, alpha-peptide bonds in a polypeptide chain by a mechanism in which the sulfhydryl group of a cysteine residue at the active center acts as a nucleophile, and contributing to the apoptotic process.\")\n	(instanceOf [GK_4344])\n	(name \"cysteine-type endopeptidase activity involved in apoptotic process\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133497] of  GO_BiologicalProcess\n\n	(_displayName \"apoptotic signaling pathway\")\n	(accession \"0097190\")\n	(componentOf [GK_2273])\n	(DB_ID 2133497)\n	(definition \"A series of molecular signals which triggers the apoptotic death of a cell. The pathway starts with reception of a signal, and ends when the execution phase of apoptosis is triggered.\")\n	(instanceOf [GK_141])\n	(name \"apoptotic signaling pathway\")\n	(referenceDatabase [GK_1])\n	(regulate [GK_2133501]))\n\n([GK_2133498] of  GO_BiologicalProcess\n\n	(_displayName \"extrinsic apoptotic signaling pathway\")\n	(accession \"0097191\")\n	(DB_ID 2133498)\n	(definition \"A series of molecular signals in which a signal is conveyed from the cell surface to trigger the apoptotic death of a cell. The pathway starts with either a ligand binding to a cell surface receptor, or a ligand being withdrawn from a cell surface receptor (e.g. in the case of signaling by dependence receptors), and ends when the execution phase of apoptosis is triggered.\")\n	(instanceOf\n		[GK_140]\n		[GK_2133497])\n	(name \"extrinsic apoptotic signaling pathway\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133499] of  GO_BiologicalProcess\n\n	(_displayName \"extrinsic apoptotic signaling pathway in absence of ligand\")\n	(accession \"0097192\")\n	(DB_ID 2133499)\n	(definition \"A series of molecular signals in which a signal is conveyed from the cell surface to trigger the apoptotic death of a cell. The pathway starts with withdrawal of a ligand from a cell surface receptor, and ends when the execution phase of apoptosis is triggered.\")\n	(instanceOf\n		[GK_2132740]\n		[GK_2133498])\n	(name \"extrinsic apoptotic signaling pathway in absence of ligand\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133501] of  GO_BiologicalProcess\n\n	(_displayName \"execution phase of apoptosis\")\n	(accession \"0097194\")\n	(componentOf [GK_2273])\n	(DB_ID 2133501)\n	(definition \"A stage of the apoptotic process that starts with the controlled breakdown of the cell through the action of effector caspases or other effector molecules (e.g. cathepsins, calpains etc.). Key steps of the execution phase are rounding-up of the cell, retraction of pseudopodes, reduction of cellular volume (pyknosis), chromatin condensation, nuclear fragmentation (karyorrhexis), plasma membrane blebbing and fragmentation of the cell into apoptotic bodies. The execution phase ends when the cell has died.\")\n	(instanceOf [GK_3132308])\n	(name \"execution phase of apoptosis\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133509] of  GO_BiologicalProcess\n\n	(_displayName \"activation of cysteine-type endopeptidase activity\")\n	(accession \"0097202\")\n	(DB_ID 2133509)\n	(definition \"Any process that initiates the activity of the inactive enzyme cysteine-type endopeptidase.\")\n	(instanceOf [GK_1996045])\n	(name \"activation of cysteine-type endopeptidase activity\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133692] of  GO_BiologicalProcess\n\n	(_displayName \"regulation of apoptotic signaling pathway\")\n	(accession \"2001233\")\n	(DB_ID 2133692)\n	(definition \"Any process that modulates the frequency, rate or extent of apoptotic signaling pathway.\")\n	(instanceOf\n		[GK_6192]\n		[GK_139812])\n	(name \"regulation of apoptotic signaling pathway\")\n	(referenceDatabase [GK_1])\n	(regulate [GK_2133497]))\n\n([GK_2133693] of  GO_BiologicalProcess\n\n	(_displayName \"negative regulation of apoptotic signaling pathway\")\n	(accession \"2001234\")\n	(DB_ID 2133693)\n	(definition \"Any process that stops, prevents or reduces the frequency, rate or extent of apoptotic signaling pathway.\")\n	(instanceOf\n		[GK_6196]\n		[GK_2133692])\n	(name \"negative regulation of apoptotic signaling pathway\")\n	(negativelyRegulate [GK_2133497])\n	(referenceDatabase [GK_1]))\n\n([GK_2133695] of  GO_BiologicalProcess\n\n	(_displayName \"regulation of extrinsic apoptotic signaling pathway\")\n	(accession \"2001236\")\n	(DB_ID 2133695)\n	(definition \"Any process that modulates the frequency, rate or extent of extrinsic apoptotic signaling pathway.\")\n	(instanceOf [GK_2133692])\n	(name \"regulation of extrinsic apoptotic signaling pathway\")\n	(referenceDatabase [GK_1])\n	(regulate [GK_2133498]))\n\n([GK_2133696] of  GO_BiologicalProcess\n\n	(_displayName \"negative regulation of extrinsic apoptotic signaling pathway\")\n	(accession \"2001237\")\n	(DB_ID 2133696)\n	(definition \"Any process that stops, prevents or reduces the frequency, rate or extent of extrinsic apoptotic signaling pathway.\")\n	(instanceOf\n		[GK_2133693]\n		[GK_2133695])\n	(name \"negative regulation of extrinsic apoptotic signaling pathway\")\n	(negativelyRegulate [GK_2133498])\n	(referenceDatabase [GK_1]))\n\n([GK_2133698] of  GO_BiologicalProcess\n\n	(_displayName \"regulation of extrinsic apoptotic signaling pathway in absence of ligand\")\n	(accession \"2001239\")\n	(DB_ID 2133698)\n	(definition \"Any process that modulates the frequency, rate or extent of extrinsic apoptotic signaling pathway in absence of ligand.\")\n	(instanceOf [GK_2133695])\n	(name \"regulation of extrinsic apoptotic signaling pathway in absence of ligand\")\n	(referenceDatabase [GK_1])\n	(regulate [GK_2133499]))\n\n([GK_216603] of  Person\n\n	(_displayName \"Munier, FL\")\n	(DB_ID 216603)\n	(initial \"FL\")\n	(surname \"Munier\"))\n\n([GK_216645] of  Person\n\n	(_displayName \"Schorderet, DF\")\n	(DB_ID 216645)\n	(initial \"DF\")\n	(surname \"Schorderet\"))\n\n([GK_217036] of  Person\n\n	(_displayName \"Lee, M\")\n	(DB_ID 217036)\n	(initial \"M\")\n	(surname \"Lee\"))\n\n([GK_217173] of  Person\n\n	(_displayName \"Seki, M\")\n	(DB_ID 217173)\n	(initial \"M\")\n	(surname \"Seki\"))\n\n([GK_2266716] of  GO_BiologicalProcess\n\n	(_displayName \"regulation of execution phase of apoptosis\")\n	(accession \"1900117\")\n	(DB_ID 2266716)\n	(definition \"Any process that modulates the frequency, rate or extent of execution phase of apoptosis.\")\n	(instanceOf [GK_139812])\n	(name \"regulation of execution phase of apoptosis\")\n	(referenceDatabase [GK_1])\n	(regulate [GK_2133501]))\n\n([GK_2273] of  GO_BiologicalProcess\n\n	(_displayName \"apoptotic process\")\n	(accession \"0006915\")\n	(DB_ID 2273)\n	(definition \"A programmed cell death process which begins when a cell receives an internal (e.g. DNA damage) or external signal (e.g. an extracellular death ligand), and proceeds through a series of biochemical events (signaling pathways) which typically lead to rounding-up of the cell, retraction of pseudopodes, reduction of cellular volume (pyknosis), chromatin condensation, nuclear fragmentation (karyorrhexis), plasma membrane blebbing and fragmentation of the cell into apoptotic bodies. The process ends when the cell has died. The process is divided into a signaling pathway phase, and an execution phase, which is triggered by the former.\")\n	(instanceOf [GK_2274])\n	(name \"apoptotic process\")\n	(referenceDatabase [GK_1]))\n\n([GK_2274] of  GO_BiologicalProcess\n\n	(_displayName \"programmed cell death\")\n	(accession \"0012501\")\n	(DB_ID 2274)\n	(definition \"A process which begins when a cell receives an internal or external signal and activates a series of biochemical events (signaling pathway). The process ends with the death of the cell.\")\n	(instanceOf [GK_2275])\n	(name \"programmed cell death\")\n	(referenceDatabase [GK_1]))\n\n([GK_2275] of  GO_BiologicalProcess\n\n	(_displayName \"cell death\")\n	(accession \"0008219\")\n	(DB_ID 2275)\n	(definition \"Any biological process that results in permanent cessation of all vital functions of a cell. A cell should be considered dead when any one of the following molecular or morphological criteria is met: (1) the cell has lost the integrity of its plasma membrane; (2) the cell, including its nucleus, has undergone complete fragmentation into discrete bodies (frequently referred to as \\\"apoptotic bodies\\\"); and/or (3) its corpse (or its fragments) have been engulfed by an adjacent cell in vivo.\")\n	(instanceOf\n		[GK_2276]\n		[GK_3132308])\n	(name \"cell death\")\n	(referenceDatabase [GK_1]))\n\n([GK_2276] of  GO_BiologicalProcess\n\n	(_displayName \"death\")\n	(accession \"0016265\")\n	(DB_ID 2276)\n	(definition \"A permanent cessation of all vital functions: the end of life; can be applied to a whole organism or to a part of an organism.\")\n	(instanceOf [GK_2587987])\n	(name \"death\")\n	(referenceDatabase [GK_1]))\n\n([GK_231418] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:Q6FI13 HIST2H2AA3 recommendedName: Histone H2A type 2-A  alternativeName: Histone H2A.2  alternativeName: Histone H2A/o \")\n	(checksum \"1\")\n	(comment \"FUNCTION Core component of nucleosome. Nucleosomes wrap and compact DNA into chromatin, limiting DNA accessibility to the cellular machineries which require DNA as a template. Histones thereby play a central role in transcription regulation, DNA repair, DNA replication and chromosomal stability. DNA accessibility is regulated via a complex set of post-translational modifications of histones, also called histone code, and nucleosome remodeling.SUBUNIT The nucleosome is a histone octamer containing two molecules each of H2A, H2B, H3 and H4 assembled in one H3-H4 heterotetramer and two H2A-H2B heterodimers. The octamer wraps approximately 147 bp of DNA.PTM Deiminated on Arg-4 in granulocytes upon calcium entry.PTM Phosphorylation on Ser-2 is enhanced during mitosis. Phosphorylation on Ser-2 by RPS6KA5/MSK1 directly represses transcription. Acetylation of H3 inhibits Ser-2 phosphorylation by RPS6KA5/MSK1.SIMILARITY Belongs to the histone H2A family.\")\n	(DB_ID 231418)\n	(description \"recommendedName: Histone H2A type 2-A  alternativeName: Histone H2A.2  alternativeName: Histone H2A/o \")\n	(geneName\n		\"HIST2H2AA3\"\n		\"H2AFO\"\n		\"HIST2H2AA\"\n		\"</gene>\"\n		\"<gene>\"\n		\"HIST2H2AA4\")\n	(identifier \"Q6FI13\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"Acetylation\"\n		\"Chromosome\"\n		\"Citrullination\"\n		\"Complete proteome\"\n		\"DNA-binding\"\n		\"Isopeptide bond\"\n		\"Methylation\"\n		\"Nucleosome core\"\n		\"Nucleus\"\n		\"Phosphoprotein\"\n		\"Ubl conjugation\")\n	(name \"HIST2H2AA3\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"H2A2A_HUMAN\"\n		\"B2R5F0\"\n		\"P20670\")\n	(sequenceLength 130)\n	(species [GK_48887]))\n\n([GK_231427] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P0C5Y9 H2AFB1 recommendedName: Histone H2A-Bbd type 1  alternativeName: H2A Barr body-deficient shortName:H2A.Bbd  alternativeName: H2A Barr body-deficient shortName:H2A.Bbd \")\n	(checksum \"1\")\n	(comment \"SUBUNIT The nucleosome is a histone octamer containing two molecules each of H2A, H2B, H3 and H4 assembled in one H3-H4 heterotetramer and two H2A-H2B heterodimers. May be incorporated into a proportion of nucleosomes, replacing one or more H2A molecules.MISCELLANEOUS In contrast to other H2A histones, it does not contain the conserved residues that are the target of post-translational modifications.SIMILARITY Belongs to the histone H2A family.\")\n	(DB_ID 231427)\n	(description \"recommendedName: Histone H2A-Bbd type 1  alternativeName: H2A Barr body-deficient shortName:H2A.Bbd  alternativeName: H2A Barr body-deficient shortName:H2A.Bbd \")\n	(geneName \"H2AFB1\")\n	(identifier \"P0C5Y9\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"Chromosome\"\n		\"Complete proteome\"\n		\"DNA-binding\"\n		\"Nucleosome core\"\n		\"Nucleus\")\n	(name \"H2AFB1\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"H2AB1_HUMAN\"\n		\"P98176\"\n		\"Q5TZB2\"\n		\"Q6FG78\"\n		\"Q96PR7\")\n	(sequenceLength 115)\n	(species [GK_48887]))\n\n([GK_231437] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P0C0S5 H2AFZ recommendedName: Histone H2A.Z shortName:H2A/z \")\n	(checksum \"1\")\n	(comment \"PTM Monoubiquitination of Lys-122 gives a specific tag for epigenetic transcriptional repression.SIMILARITY Belongs to the histone H2A family.\")\n	(DB_ID 231437)\n	(description \"recommendedName: Histone H2A.Z shortName:H2A/z \")\n	(geneName\n		\"H2AFZ\"\n		\"H2AZ\")\n	(identifier \"P0C0S5\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Acetylation\"\n		\"Chromosome\"\n		\"Complete proteome\"\n		\"DNA-binding\"\n		\"Isopeptide bond\"\n		\"Nucleosome core\"\n		\"Nucleus\"\n		\"Ubl conjugation\")\n	(name \"H2AFZ\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"H2AZ_HUMAN\"\n		\"B2RD56\"\n		\"P17317\"\n		\"Q6I9U0\")\n	(sequenceLength 128)\n	(speci