ion \"Any process that modulates the frequency, rate or extent of extrinsic apoptotic signaling pathway via death domain receptors.\")\n	(instanceOf [GK_2133695])\n	(name \"regulation of extrinsic apoptotic signaling pathway via death domain receptors\")\n	(referenceDatabase [GK_1])\n	(regulate [GK_25449]))\n\n([GK_3446166] of  GO_BiologicalProcess\n\n	(_displayName \"negative regulation of extrinsic apoptotic signaling pathway via death domain receptors\")\n	(accession \"1902042\")\n	(DB_ID 3446166)\n	(definition \"Any process that stops, prevents or reduces the frequency, rate or extent of extrinsic apoptotic signaling pathway via death domain receptors.\")\n	(instanceOf\n		[GK_3446165]\n		[GK_2133696])\n	(name \"negative regulation of extrinsic apoptotic signaling pathway via death domain receptors\")\n	(negativelyRegulate [GK_25449])\n	(referenceDatabase [GK_1]))\n\n([GK_3465328] of  Summation\n\n	(_displayName \"In the presence of FLIP(L), both caspase-8 and FLIP(L) are r...\")\n	(DB_ID 3465328)\n	(literatureReference\n		[GK_1250231]\n		[GK_3465478]\n		[GK_3465386]\n		[GK_1267786])\n	(text \"In the presence of FLIP(L), both caspase-8 and FLIP(L) are recruited and partially processed at the death-inducing signaling complex (DISC). The partially processed proteins stay bound to the DISC.<p>The long cellular FLIP (FLIP(L) or c-FLIPL) has two death effector domains (DED) and a caspase-like domain that lacks catalytic activity due to absence of a cysteine residue. Processing of FLIP(L) occurs at the DISC and depends on caspase-8 activity (zymogen and mature form). Upon activation FLIP(L) is cleaved to generate N-terminal FLIP(p43) and C-terminal FLIP(p12)(Irmler M et al. 1997; Jong WY et al. 2009). Processed FLIP(L) can enhance the proteolytic activity of procaspase-8 (Chang DW et al. 2002; Jong WY et al. 2009; Pop C et al. 2011). However, the increased FLIP(L) protein levels in cells have been found to limit caspase-8 activity and inhibit apoptotic signaling pathway,\"))\n\n([GK_3465329] of  Person\n\n	(_displayName \"Kovacsovics, M\")\n	(DB_ID 3465329)\n	(firstname \"M\")\n	(initial \"M\")\n	(surname \"Kovacsovics\"))\n\n([GK_3465330] of  LiteratureReference\n\n	(_displayName \"PKC-mediated phosphorylation regulates c-FLIP ubiquitylation and stability\")\n	(author\n		[GK_3465388]\n		[GK_3465434]\n		[GK_3465500]\n		[GK_3465458]\n		[GK_3465344]\n		[GK_3465498]\n		[GK_3465331])\n	(DB_ID 3465330)\n	(journal \"Cell Death Differ.\")\n	(pages \"1215-26\")\n	(pubMedIdentifier 19343040)\n	(title \"PKC-mediated phosphorylation regulates c-FLIP ubiquitylation and stability\")\n	(volume 16)\n	(year 2009))\n\n([GK_3465331] of  Person\n\n	(_displayName \"Eriksson, J E\")\n	(DB_ID 3465331)\n	(firstname \"J E\")\n	(initial \"JE\")\n	(surname \"Eriksson\"))\n\n([GK_3465333] of  Person\n\n	(_displayName \"Kennedy, N\")\n	(DB_ID 3465333)\n	(firstname \"N\")\n	(initial \"N\")\n	(surname \"Kennedy\"))\n\n([GK_3465334] of  LiteratureReference\n\n	(_displayName \"The caspase-8 inhibitor FLIP promotes activation of NF-kappaB and Erk signaling pathways\")\n	(author\n		[GK_3465376]\n		[GK_3465485]\n		[GK_3465398]\n		[GK_2672174]\n		[GK_3465452]\n		[GK_3465449]\n		[GK_2672170]\n		[GK_3465481]\n		[GK_3465333]\n		[GK_3465329]\n		[GK_2672175])\n	(DB_ID 3465334)\n	(journal \"Curr. Biol.\")\n	(pages \"640-8\")\n	(pubMedIdentifier 10837247)\n	(title \"The caspase-8 inhibitor FLIP promotes activation of NF-kappaB and Erk signaling pathways\")\n	(volume 10)\n	(year 2000))\n\n([GK_3465335] of  Person\n\n	(_displayName \"Eils, Roland\")\n	(DB_ID 3465335)\n	(firstname \"Roland\")\n	(initial \"R\")\n	(surname \"Eils\"))\n\n([GK_3465336] of  Person\n\n	(_displayName \"Vittori, Daniela\")\n	(DB_ID 3465336)\n	(firstname \"Daniela\")\n	(initial \"D\")\n	(surname \"Vittori\"))\n\n([GK_3465337] of  Person\n\n	(_displayName \"Langa, Susana\")\n	(DB_ID 3465337)\n	(firstname \"Susana\")\n	(initial \"S\")\n	(surname \"Langa\"))\n\n([GK_3465338] of  Person\n\n	(_displayName