dition to two DEDs, FLIP(L) contains a large (p20) and a small (p12) caspase-like domain without catalytic activity. FLIP(S) and FLIP(R) consist of two DEDs and a small C terminus. Depending on its level of expression FLIP(L) may function as an anti-apoptotic or pro-apoptotic factor, while FLIP(S) and FLIP(R) protect cells from apoptosis by blocking the processing of caspase-8 at the receptor level (Scaffidi C et al. 1999; Golks A et al. 2005; Toivonen HT et al. 2011; Fricker N et al. 2010).\"))\n\n([GK_3465347] of  Person\n\n	(_displayName \"Siegmund, D\")\n	(DB_ID 3465347)\n	(firstname \"D\")\n	(initial \"D\")\n	(surname \"Siegmund\"))\n\n([GK_3465348] of  Person\n\n	(_displayName \"Krammer, Peter H\")\n	(DB_ID 3465348)\n	(firstname \"Peter H\")\n	(initial \"PH\")\n	(surname \"Krammer\"))\n\n([GK_3465349] of  Person\n\n	(_displayName \"Chung, Jee Y\")\n	(DB_ID 3465349)\n	(firstname \"Jee Y\")\n	(initial \"JY\")\n	(surname \"Chung\"))\n\n([GK_3465350] of  Person\n\n	(_displayName \"Callero, Mariana\")\n	(DB_ID 3465350)\n	(firstname \"Mariana\")\n	(initial \"M\")\n	(surname \"Callero\"))\n\n([GK_3465351] of  Person\n\n	(_displayName \"Johnson, Mark S\")\n	(DB_ID 3465351)\n	(firstname \"Mark S\")\n	(initial \"MS\")\n	(surname \"Johnson\"))\n\n([GK_3465352] of  Complex\n\n	(_displayName \"[Hsa] DISC:procaspase-8:FLIP(S) [plasma membrane]\")\n	(compartment [GK_876])\n	(DB_ID 3465352)\n	(hasComponent\n		[GK_3465443]\n		[GK_3465357])\n	(isChimeric FALSE)\n	(name \"DISC:procaspase-8:FLIP(S)\")\n	(species [GK_48887])\n	(stableIdentifier [GK_3654708]))\n\n([GK_3465353] of  LiteratureReference\n\n	(_displayName \"A novel mechanism of TRAF signaling revealed by structural and functional analyses of the TRADD-TRAF2 interaction\")\n	(author\n		[GK_141860]\n		[GK_3465399]\n		[GK_3465372]\n		[GK_141862]\n		[GK_141861]\n		[GK_3465419]\n		[GK_141863]\n		[GK_141864])\n	(DB_ID 3465353)\n	(journal \"Cell\")\n	(pages \"777-87\")\n	(pubMedIdentifier 10892748)\n	(title \"A novel mechanis