(DED) and caspase-like domain (CLD). In addition, FLIP-L can also regulate TNF-R1 signaling via interaction with the DED of FADD. The regulatory function of FLIP(L) has been found to differ depending on its expression levels. c-FLIP was shown to inhibit death receptor (DR)-mediated apoptosis only when expressed at high levels, while low cell levels of FLIP(L) enhanced DR signaling to apoptosis (Boatright KM et al. 2004; Okano H et al. 2003; Yerbes R et al. 2011). The expression levels of c-FLIP proteins were shown to be regulated by NFkappaB signaling pathway (Micheau O et a. 2001; Kreuz S et al 2001).\"))\n\n([GK_3465403] of  Person\n\n	(_displayName \"Murata, Kazumoto\")\n	(DB_ID 3465403)\n	(firstname \"Kazumoto\")\n	(initial \"K\")\n	(surname \"Murata\"))\n\n([GK_3465404] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] CASP8(1-374) [cytosol]\")\n	(compartment [GK_70101])\n	(DB_ID 3465404)\n	(endCoordinate 374)\n	(name\n		\"CASP8(1-374)\"\n		\"caspase-8 p43/41 fragment\"\n		\"ICE-like apoptotic protease 5\"\n		\"MORT1-associated CED-3 homolog\"\n		\"MACH\"\n		\"FADD-homologous ICE/CED-3- like protease\"\n		\"FADD-like ICE\"\n		\"FLICE\"\n		\"Apoptotic cysteine protease\"\n		\"Apoptotic protease Mch-5\"\n		\"CAP4\")\n	(referenceEntity [GK_57032])\n	(species [GK_48887])\n	(stableIdentifier [GK_3655311])\n	(startCoordinate 1))\n\n([GK_3465405] of  LiteratureReference\n\n	(_displayName \"Cellular FLICE/caspase-8-inhibitory protein as a principal regulator of cell death and survival in human hepatocellular carcinoma\")\n	(author\n		[GK_3465509]\n		[GK_3465479]\n		[GK_3465377]\n		[GK_3465409]\n		[GK_3465471]\n		[GK_3465407]\n		[GK_3465440]\n		[GK_3465426]\n		[GK_3465400]\n		[GK_3465477]\n		[GK_3465403]\n		[GK_3465465])\n	(DB_ID 3465405)\n	(journal \"Lab. Invest.\")\n	(pages \"1033-43\")\n	(pubMedIdentifier 12861043)\n	(title \"Cellular FLICE/caspase-8-inhibitory protein as a principal regulator of cell death and survival in human hepatocellular carcinoma\")\