caspase-8 form heterodimer\")\n	(output [GK_3465352])\n	(precedingEvent\n		[GK_83586]\n		[GK_75240]\n		[GK_75146])\n	(releaseDate \"2013-06-11\")\n	(reviewed [GK_3597630])\n	(species [GK_48887])\n	(stableIdentifier [GK_3654525])\n	(summation [GK_3465395]))\n\n([GK_3465430] of  Person\n\n	(_displayName \"Alevizopoulos, K\")\n	(DB_ID 3465430)\n	(firstname \"K\")\n	(initial \"K\")\n	(surname \"Alevizopoulos\"))\n\n([GK_3465431] of  Complex\n\n	(_displayName \"[Hsa] DISC:p43/p41CASP8:p43 FLIP(L) [plasma membrane]\")\n	(compartment [GK_876])\n	(DB_ID 3465431)\n	(hasComponent\n		[GK_3465408]\n		[GK_2671814]\n		[GK_3465404])\n	(isChimeric FALSE)\n	(name \"DISC:p43/p41CASP8:p43 FLIP(L)\")\n	(species [GK_48887])\n	(stableIdentifier [GK_3654957]))\n\n([GK_3465432] of  Summation\n\n	(_displayName \"Pro-caspase-8 and FLIP(L) are recruited to FAS/CD95 receptor...\")\n	(DB_ID 3465432)\n	(literatureReference\n		[GK_3465456]\n		[GK_3465380]\n		[GK_1267757]\n		[GK_3465405]\n		[GK_3465503]\n		[GK_3465393]\n		[GK_3465478])\n	(text \"Pro-caspase-8 and FLIP(L) are recruited to FAS/CD95 receptor complex where FLIP(L) forms a heterodimer with caspase-8 through both death effector domain (DED) and caspase-like domain (CLD). In addition, FLIP(L) can also regulate signaling via interaction with the DED of FADD. The regulatory function of FLIP(L) has been found to differ depending on its expression levels. FLIP(L) was shown to inhibit death receptor (DR)-mediated apoptosis only when expressed at high levels, while low cell levels of FLIP-L enhanced DR signaling to apoptosis (Chang DW et al. 2002; Fricker N et al. 2010; Toivonen HT et al. 2011; Boatright KM et al. 2004; Okano H et al. 2003). The expression levels of c-FLIP proteins were shown to be regulated by NFkappaB signaling pathway (Micheau O et a. 2001; Kreuz S et al 2001).\"))\n\n([GK_3465433] of  Person\n\n	(_displayName \"Pettersson, Frank\")\n	(DB_ID 3465433)\n	(firstname \"Frank\")\n	(initial \"F\")\n	(surname \"Pettersson\"))\n\n(