465445)\n	(firstname \"S\")\n	(initial \"S\")\n	(surname \"Kreuz\"))\n\n([GK_3465446] of  Summation\n\n	(_displayName \"Pro-caspase-8 and FLIP(L) are recruited to the DISC. Followi...\")\n	(DB_ID 3465446)\n	(literatureReference\n		[GK_3465460]\n		[GK_3465396]\n		[GK_1267757]\n		[GK_3465405]\n		[GK_3465422]\n		[GK_3465503]\n		[GK_3465393])\n	(text \"Pro-caspase-8 and FLIP(L) are recruited to the DISC. Following recruitment to the DISC, FLIP-L forms a heterodimer with caspase-8 through both death effector domain (DED) and caspase-like domain (CLD). In addition, FLIP(L) can also regulate signaling via interaction with the DED of FADD. The regulatory function of FLIP(L) has been found to differ depending on its expression levels. FLIP(L) was shown to inhibit death receptor (DR)-mediated apoptosis only when expressed at high levels, while low cell levels of FLIP(L) enhanced DR signaling to apoptosis (Sharp DA et al. 2005; Siegmund D et al. 2002; Boatright KM et al. 2004; Okano H et al. 2003; Yerbes R et al. 2011). The expression levels of c-FLIP proteins were shown to be regulated by NFkappaB signaling pathway (Micheau O et a. 2001; Kreuz S et al 2001).\"))\n\n([GK_3465447] of  Person\n\n	(_displayName \"Stadel, Dominic\")\n	(DB_ID 3465447)\n	(firstname \"Dominic\")\n	(initial \"D\")\n	(surname \"Stadel\"))\n\n([GK_3465448] of  BlackBoxEvent\n\n	(_displayName \"[Hsa] Caspase-8 and FLIP(L) processing at DISC\")\n	(_doRelease TRUE)\n	(authored [GK_3371406])\n	(catalystActivity [GK_139951])\n	(compartment [GK_70101])\n	(DB_ID 3465448)\n	(edited [GK_3508822])\n	(input [GK_3371381])\n	(literatureReference\n		[GK_1267786]\n		[GK_3465386]\n		[GK_3465412]\n		[GK_1267836]\n		[GK_3465456]\n		[GK_3465334])\n	(name \"Caspase-8 and FLIP(L) processing at DISC\")\n	(output\n		[GK_3465431]\n		[GK_3465483])\n	(precedingEvent\n		[GK_3465459]\n		[GK_3371360]\n		[GK_3371359])\n	(releaseDate \"2013-06-11\")\n	(reviewed [GK_3597630])\n	(species [GK_48887])\n	(stableIdentifier [GK_3654297])\n	