dentifierVersion \"1\"))\n\n([GK_397759] of  StableIdentifier\n\n	(_displayName \"REACT_16868.1\")\n	(DB_ID 397759)\n	(identifier \"REACT_16868\")\n	(identifierVersion \"1\"))\n\n([GK_401351] of  ReferenceIsoform\n\n	(_displayName \"[Hsa] UniProt:O15519-1 CFLAR recommendedName: CASP8 and FADD-like apoptosis regulator  alternativeName: Caspase homolog shortName:CASH  alternativeName: Caspase-eight-related protein shortName:Casper  alternativeName: Caspase-like apoptosis regulatory protein shortName:CLARP  alternativeName: Cellular FLICE-like inhibitory protein shortName:c-FLIP  alternativeName: FADD-like antiapoptotic molecule 1 shortName:FLAME-1  alternativeName: Inhibitor of FLICE shortName:I-FLICE  alternativeName: MACH-related inducer of toxicity shortName:MRIT  alternativeName: Usurpin  component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p43  /component component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p12  /component\")\n	(checksum \"8C6D7E92AE1EB672\")\n	(comment \"FUNCTION Apoptosis regulator protein which may function as a crucial link between cell survival and cell death pathways in mammalian cells. Acts as an inhibitor of TNFRSF6 mediated apoptosis. A proteolytic fragment (p43) is likely retained in the death-inducing signaling complex (DISC) thereby blocking further recruitment and processing of caspase-8 at the complex. Full length and shorter isoforms have been shown either to induce apoptosis or to reduce TNFRSF-triggered apoptosis. Lacks enzymatic (caspase) activity.SUBUNIT TNFRSF6 stimulation triggers recruitment to the death-inducing signaling complex (DISC) formed by TNFRSF6, FADD and caspase-8. A proteolytic fragment (p43) stays associated with the DISC. Also interacts with caspase-10, caspase-3, TRAF1, TRAF2 and Bcl-X(L) (in vitro). Interacts with HBV protein X.TISSUE SPECIFICITY Widely expressed. Higher expression in skeletal muscle, pancreas, heart, kidney, placenta, and peripheral blood leukocytes. Also detected in diverse cell lines. Isoform 8 is predominantly expressed in testis and skeletal muscle.INDUCTION Repressed by IL2/interleukin-2 after TCR stimulation, during progression to the S phase of the cell cycle.DOMAIN The caspase domain lacks the active sites residues involved in catalysis.PTM Proteolytically processed; probably by caspase-8. Processing likely occurs at the DISC and generates subunit p43 and p12.SIMILARITY Belongs to the peptidase C14A family.SIMILARITY Contains 2 DED (death effector) domains.\")\n	(DB_ID 401351)\n	(description \"recommendedName: CASP8 and FADD-like apoptosis regulator  alternativeName: Caspase homolog shortName:CASH  alternativeName: Caspase-eight-related protein shortName:Casper  alternativeName: Caspase-like apoptosis regulatory protein shortName:CLARP  alternativeName: Cellular FLICE-like inhibitory protein shortName:c-FLIP  alternativeName: FADD-like antiapoptotic molecule 1 shortName:FLAME-1  alternativeName: Inhibitor of FLICE shortName:I-FLICE  alternativeName: MACH-related inducer of toxicity shortName:MRIT  alternativeName: Usurpin  component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p43  /component component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p12  /component\")\n	(geneName\n		\"CFLAR\"\n		\"CASH\"\n		\"CASP8AP1\"\n		\"CLARP\"\n		\"MRIT\")\n	(identifier \"O15519\")\n	(isoformParent [GK_51926])\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Apoptosis\"\n		\"Complete proteome\"\n		\"Host-virus interaction\"\n		\"Polymorphism\"\n		\"Reference proteome\"\n		\"Repeat\")\n	(name \"CFLAR\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"CFLAR_HUMAN\"\n		\"B4DJE0\"\n		\"B7Z9F9\"\n		\"O14673\"\n		\"O14674\"\n		\"O14675\"\n		\"O15137\"\n		\"O15138\"\n		\"O15356\"\n		\"O15510\"\n		\"O43618\"\n		\"O43619\"\n		\"O43620\"\n		\"O60458\"\n		\"O60459\"\n		\"Q53TS6\"\n		\"Q54AF1\"\n		\"Q96TE4\"\n		\"Q9UEW1\")\n	(sequenceLe