ilage.DOMAIN The conserved cysteine present in the cysteine-switch motif binds the catalytic zinc ion, thus inhibiting the enzyme. The dissociation of the cysteine from the zinc ion upon the activation-peptide release activates the enzyme.PTM Phosphorylated. Stimulation by growth factor or phorbol 12-myristate 13-acetate induces phosphorylation of Ser-819 but decreases phosphorylation of Ser-791. Phosphorylation at THR-735 by MAPK14 is required for ADAM17-mediated ectodomain shedding.SIMILARITY Contains 1 disintegrin domain.SIMILARITY Contains 1 peptidase M12B domain.\")\n	(DB_ID 49678)\n	(description \"recommendedName: Disintegrin and metalloproteinase domain-containing protein 17 shortName:ADAM 17 ecNumber3.4.24.86/ecNumber  alternativeName: Snake venom-like protease  alternativeName: TNF-alpha convertase  alternativeName: TNF-alpha-converting enzyme  cdAntigenNameCD156b/cdAntigenName\")\n	(geneName\n		\"ADAM17\"\n		\"CSVP\"\n		\"TACE\")\n	(identifier \"P78536\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Cleavage on pair of basic residues\"\n		\"Complete proteome\"\n		\"Direct protein sequencing\"\n		\"Disulfide bond\"\n		\"Glycoprotein\"\n		\"Hydrolase\"\n		\"Membrane\"\n		\"Metal-binding\"\n		\"Metalloprotease\"\n		\"Notch signaling pathway\"\n		\"Phosphoprotein\"\n		\"Polymorphism\"\n		\"Protease\"\n		\"Reference proteome\"\n		\"SH3-binding\"\n		\"Signal\"\n		\"Transmembrane\"\n		\"Transmembrane helix\"\n		\"Zinc\"\n		\"Zymogen\")\n	(name \"ADAM17\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"ADA17_HUMAN\"\n		\"O60226\")\n	(sequenceLength 824)\n	(species [GK_48887]))\n\n([GK_49984] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P01160 NPPA recommendedName: Natriuretic peptides A  alternativeName: CDD-ANF  alternativeName: Prepronatriodilatin  component recommendedName: Cardiodilatin-related peptide shortName:CDP  /component component recommendedName: Atrial natriuretic factor shortName: