to-epithelin  alternativeName: RGD-containing collagen-associated protein shortName:RGD-CAP  alternativeName: RGD-containing collagen-associated protein shortName:RGD-CAP \")\n	(geneName\n		\"TGFBI\"\n		\"BIGH3\")\n	(identifier \"Q15582\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Amyloid\"\n		\"Cell adhesion\"\n		\"Complete proteome\"\n		\"Disease mutation\"\n		\"Disulfide bond\"\n		\"Extracellular matrix\"\n		\"Gamma-carboxyglutamic acid\"\n		\"Polymorphism\"\n		\"Repeat\"\n		\"Secreted\"\n		\"Sensory transduction\"\n		\"Signal\"\n		\"Vision\")\n	(name \"TGFBI\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"BGH3_HUMAN\"\n		\"D3DQB1\"\n		\"O14471\"\n		\"O14472\"\n		\"O14476\"\n		\"O43216\"\n		\"O43217\"\n		\"O43218\"\n		\"O43219\"\n		\"Q53XM1\")\n	(sequenceLength 683)\n	(species [GK_48887]))\n\n([GK_517749] of  Person\n\n	(_displayName \"Hudson, J\")\n	(DB_ID 517749)\n	(initial \"J\")\n	(surname \"Hudson\"))\n\n([GK_51926] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:O15519 CFLAR recommendedName: CASP8 and FADD-like apoptosis regulator  alternativeName: Caspase homolog shortName:CASH  alternativeName: Caspase-eight-related protein shortName:Casper  alternativeName: Caspase-like apoptosis regulatory protein shortName:CLARP  alternativeName: Cellular FLICE-like inhibitory protein shortName:c-FLIP  alternativeName: FADD-like antiapoptotic molecule 1 shortName:FLAME-1  alternativeName: Inhibitor of FLICE shortName:I-FLICE  alternativeName: MACH-related inducer of toxicity shortName:MRIT  alternativeName: Usurpin  component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p43  /component component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p12  /component\")\n	(checksum \"8C6D7E92AE1EB672\")\n	(comment \"FUNCTION Apoptosis regulator protein which may function as a crucial link between cell survival and cell death pathways in mammalian cells. Acts as an inhibitor of TNFRSF6 mediated apoptosis. A proteolytic fragment (p43) is likely retained in the death-inducing signaling complex (DISC) thereby blocking further recruitment and processing of caspase-8 at the complex. Full length and shorter isoforms have been shown either to induce apoptosis or to reduce TNFRSF-triggered apoptosis. Lacks enzymatic (caspase) activity.SUBUNIT TNFRSF6 stimulation triggers recruitment to the death-inducing signaling complex (DISC) formed by TNFRSF6, FADD and caspase-8. A proteolytic fragment (p43) stays associated with the DISC. Also interacts with caspase-10, caspase-3, TRAF1, TRAF2 and Bcl-X(L) (in vitro). Interacts with HBV protein X.TISSUE SPECIFICITY Widely expressed. Higher expression in skeletal muscle, pancreas, heart, kidney, placenta, and peripheral blood leukocytes. Also detected in diverse cell lines. Isoform 8 is predominantly expressed in testis and skeletal muscle.INDUCTION Repressed by IL2/interleukin-2 after TCR stimulation, during progression to the S phase of the cell cycle.DOMAIN The caspase domain lacks the active sites residues involved in catalysis.PTM Proteolytically processed; probably by caspase-8. Processing likely occurs at the DISC and generates subunit p43 and p12.SIMILARITY Belongs to the peptidase C14A family.SIMILARITY Contains 2 DED (death effector) domains.\")\n	(DB_ID 51926)\n	(description \"recommendedName: CASP8 and FADD-like apoptosis regulator  alternativeName: Caspase homolog shortName:CASH  alternativeName: Caspase-eight-related protein shortName:Casper  alternativeName: Caspase-like apoptosis regulatory protein shortName:CLARP  alternativeName: Cellular FLICE-like inhibitory protein shortName:c-FLIP  alternativeName: FADD-like antiapoptotic molecule 1 shortName:FLAME-1  alternativeName: Inhibitor of FLICE shortName:I-FLICE  alternativeName: MACH-related inducer of toxicity shortName:MRIT  alternativeName: Usurpin  component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p43  /component component recommendedName: CASP8 and FADD-like apoptosis regulator subunit p12  /component\")\n	(geneName\n		\"CFLAR\"\n		\"CASH\"\n		\"CASP8AP1\"\n		\"CLARP\"\n		\"MRIT\")\n	(identifier \"O15519\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Apoptosis\"\n		\"Complete proteome\"\n		\"Host-virus interaction\"\n		\"Polymorphism\"\n		\"Reference proteome\"\n		\"Repeat\")\n	(name \"CFLAR\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"CFLAR_HUMAN\"\n		\"B4DJE0\"\n		\"B7Z9F9\"\n		\"O14673\"\n		\"O14674\"\n		\"O14675\"\n		\"O15137\"\n		\"O15138\"\n		\"O15356\"\n		\"O15510\"\n		\"O43618\"\n		\"O43619\"\n		\"O43620\"\n		\"O60458\"\n		\"O60459\"\n		\"Q53TS6\"\n		\"Q54AF1\"\n		\"Q96TE4\"\n		\"Q9UEW1\")\n	(sequenceLength 480)\n	(species [GK_48887]))\n\n([GK_528243] of  GO_BiologicalProcess\n\n	(_displayName \"regulation of signaling\")\n	(accession \"0023051\")\n	(DB_ID 528243)\n	(definition \"Any process that modulates the frequency, rate or extent of a signaling process.\")\n	(instanceOf [GK_139810])\n	(name \"regulation of signaling\")\n	(referenceDatabase [GK_1])\n	(regulate [GK_2587988]))\n\n([GK_528244] of  GO_BiologicalProcess\n\n	(_displayName \"signaling\")\n	(accession \"0023052\")\n	(DB_ID 528244)\n	(definition \"The entirety of a process in which information is transmitted within a biological system. This process begins with an active signal and ends when a cellular response has been triggered.\")\n	(instanceOf [GK_106])\n	(name \"signaling\")\n	(referenceDatabase [GK_1]))\n\n([GK_528249] of  GO_BiologicalProcess\n\n	(_displayName \"negative regulation of signaling\")\n	(accession \"0023057\")\n	(DB_ID 528249)\n	(definition \"Any process that stops, prevents, or reduces the frequency, rate or extent of a signaling process.\")\n	(instanceOf\n		[GK_528243]\n		[GK_160005])\n	(name \"negative regulation of signaling\")\n	(negativelyRegulate [GK_2587988])\n	(referenceDatabase [GK_1]))\n\n([GK_53331] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P01034 CST3 recommendedName: Cystatin-C  alternativeName: Cystatin-3  alternativeName: Gamma-trace  alternativeName: Neuroendocrine basic polypeptide  alternativeName: Post-gamma-globulin \")\n	(checksum \"1\")\n	(comment \"FUNCTION As an inhibitor of cysteine proteinases, this protein is thought to serve an important physiological role as a local regulator of this enzyme activity.SUBUNIT Homodimer.MISCELLANEOUS Potential cerebrospinal fluid marker for the diagnosis of Creutzfeldt-Jakob disease.SIMILARITY Belongs to the cystatin family.\")\n	(DB_ID 53331)\n	(description \"recommendedName: Cystatin-C  alternativeName: Cystatin-3  alternativeName: Gamma-trace  alternativeName: Neuroendocrine basic polypeptide  alternativeName: Post-gamma-globulin \")\n	(geneName \"CST3\")\n	(identifier \"P01034\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Age-related macular degeneration\"\n		\"Amyloid\"\n		\"Amyloidosis\"\n		\"Complete proteome\"\n		\"Direct protein sequencing\"\n		\"Disease mutation\"\n		\"Disulfide bond\"\n		\"Glycoprotein\"\n		\"Polymorphism\"\n		\"Protease inhibitor\"\n		\"Secreted\"\n		\"Signal\"\n		\"Thiol protease inhibitor\")\n	(name \"CST3\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"CYTC_HUMAN\"\n		\"B2R5J9\"\n		\"D3DW42\"\n		\"Q6FGW9\")\n	(sequenceLength 146)\n	(species [GK_48887]))\n\n([GK_538696] of  Person\n\n	(_displayName \"Enghild, JJ\")\n	(DB_ID 538696)\n	(initial \"JJ\")\n	(surname \"Enghild\"))\n\n([GK_54639] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] FADD [cytosol]\")\n	(compartment [GK_70101])\n	(DB_ID 54639)\n	(endCoordinate 208)\n	(literatureReference [GK_140483])\n	(name\n		\"FADD\"\n		\"FADD protein (FAS-associating death domain-containing protein) (Mediator of receptor induced toxicity)\"\n		\"FADD protein\"\n		\"FAS-associating death domain-containing protein\"\n		\"Mediator of receptor induced toxicity\")\n	(referenceEntity [GK_54640])\n	(species [GK_48887])\n	(stableIdentifier [GK_365546])\n	(startCoordinate 1))\n\n([GK_54640] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:Q13158 FADD recommendedName: Protein FADD  alternativeName: FAS-associated death domain protein  alternativeName: FAS-associating death domain-containing protein  alternativeName: Growth-inhibiting gene 3 protein  alternativeName: Mediator of receptor induced toxicity \")\n	(checksum \"0E65E2F852E83507\")\n	(comment \"FUNCTION Apoptotic adaptor molecule that recruits caspase-8 or caspase-10 to the activated Fas (CD95) or TNFR-1 receptors. The resulting aggregate called the death-inducing signaling complex (DISC) performs caspase-8 proteolytic activation. Active caspase-8 initiates the subsequent cascade of caspases mediating apoptosis. Involved in interferon-mediated antiviral immune response, playing a role in the positive regulation of interferon signaling.SUBUNIT Can self-associate. Interacts with CFLAR, PEA15 and MBD4. When phosphorylated, part of a complex containing HIPK3 and FAS. May interact with MAVS/IPS1. Interacts with MOCV v-CFLAR protein and LRDD. Interacts (via death domain) with FAS (via death domain). Interacts with CASP8.TISSUE SPECIFICITY Expressed in a wide variety of tissues, except for peripheral blood mononuclear leukocytes.DOMAIN Contains a death domain involved in the binding of the corresponding domain within Fas receptor.DOMAIN The interaction between the FAS and FADD death domains is crucial for the formation of the death-inducing signaling complex (DISC).SIMILARITY Contains 1 death domain.SIMILARITY Contains 1 DED (death effector) domain.\")\n	(DB_ID 54640)\n	(description \"recommendedName: Protein FADD  alternativeName: FAS-associated death domain protein  alternativeName: FAS-associating death domain-containing protein  alternativeName: Growth-inhibiting gene 3 protein  alternativeName: Mediator of receptor induced toxicity \")\n	(geneName\n		\"FADD\"\n		\"MORT1\"\n		\"GIG3\")\n	(identifier \"Q13158\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Apoptosis\"\n		\"Complete proteome\"\n		\"Disease mutation\"\n		\"Host-virus interaction\"\n		\"Immunity\"\n		\"Innate immunity\"\n		\"Phosphoprotein\"\n		\"Reference proteome\")\n	(name \"FADD\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"FADD_HUMAN\"\n		\"Q14866\"\n		\"Q6IBR4\")\n	(sequenceLength 208)\n	(species [GK_48887]))\n\n([GK_54840] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P02671 FGA recommendedName: Fibrinogen alpha chain  component recommendedName: Fibrinopeptide A  /component component recommendedName: Fibrinogen alpha chain  /component\")\n	(checksum \"1\")\n	(comment \"FUNCTION Fibrinogen has a double function: yielding monomers that polymerize into fibrin and acting as a cofactor in platelet aggregation.DOMAIN A long coiled coil structure formed by 3 polypeptide chains connects the central nodule to the C-terminal domains (distal nodules). The long C-terminal ends of the alpha chains fold back, contributing a fourth strand to the coiled coil structure.PTM Forms F13A-mediated cross-links between a glutamine and the epsilon-amino group of a lysine residue, forming fibronectin-fibrinogen heteropolymers.PTM Conversion of fibrinogen to fibrin is triggered by thrombin, which cleaves fibrinopeptides A and B from alpha and beta chains, and thus exposes the N-terminal polymerization sites responsible for the formation of the soft clot. The soft clot is converted into the hard clot by factor XIIIA which catalyzes the epsilon-(gamma-glutamyl)lysine cross-linking between gamma chains (stronger) and between alpha chains (weaker) of different monomers.PTM Phosphorylation sites are present in the extracelllular medium.DISEASE Defects in FGA are a cause of congenital afibrinogenemia (CAFBN) [MIM:202400]. This is a rare autosomal recessive disorder characterized by bleeding that varies from mild to severe and by complete absence or extremely low levels of plasma and platelet fibrinogen. Note=The majority of cases of afibrinogenemia are due to truncating mutations. Variations in position Arg-35 (the site of cleavage of fibrinopeptide a by thrombin) leads to alpha-dysfibrinogenemias.SIMILARITY Contains 1 fibrinogen C-terminal domain.\")\n	(DB_ID 54840)\n	(description \"recommendedName: Fibrinogen alpha chain  component recommendedName: Fibrinopeptide A  /component component recommendedName: Fibrinogen alpha chain  /component\")\n	(geneName \"FGA\")\n	(identifier \"P02671\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Amyloid\"\n		\"Amyloidosis\"\n		\"Blood coagulation\"\n		\"Coiled coil\"\n		\"Complete proteome\"\n		\"Direct protein sequencing\"\n		\"Disease mutation\"\n		\"Disulfide bond\"\n		\"Glycoprotein\"\n		\"Isopeptide bond\"\n		\"Phosphoprotein\"\n		\"Polymorphism\"\n		\"Secreted\"\n		\"Signal\")\n	(name \"FGA\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"FIBA_HUMAN\"\n		\"D3DP14\"\n		\"D3DP15\"\n		\"Q4QQH7\"\n		\"Q9BX62\"\n		\"Q9UCH2\")\n	(sequenceLength 866)\n	(species [GK_48887]))\n\n([GK_55564] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P06396 GSN recommendedName: Gelsolin  alternativeName: AGEL  alternativeName: Actin-depolymerizing factor shortName:ADF  alternativeName: Actin-depolymerizing factor shortName:ADF  alternativeName: Brevin \")\n	(checksum \"1\")\n	(comment \"TISSUE SPECIFICITY Phagocytic cells, platelets, fibroblasts, nonmuscle cells, smooth and skeletal muscle cells.PTM Phosphorylation on Tyr-86, Tyr-409, Tyr-465, Tyr-603 and Tyr-651 in vitro is induced in presence of phospholipids.SIMILARITY Belongs to the villin/gelsolin family.SIMILARITY Contains 6 gelsolin-like repeats.\")\n	(DB_ID 55564)\n	(description \"recommendedName: Gelsolin  alternativeName: AGEL  alternativeName: Actin-depolymerizing factor shortName:ADF  alternativeName: Actin-depolymerizing factor shortName:ADF  alternativeName: Brevin \")\n	(geneName \"GSN\")\n	(identifier \"P06396\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Actin capping\"\n		\"Actin-binding\"\n		\"Alternative initiation\"\n		\"Amyloid\"\n		\"Amyloidosis\"\n		\"Calcium\"\n		\"Cilium biogenesis/degradation\"\n		\"Complete proteome\"\n		\"Cytoplasm\"\n		\"Cytoskeleton\"\n		\"Direct protein sequencing\"\n		\"Disease mutation\"\n		\"Disulfide bond\"\n		\"Phosphoprotein\"\n		\"Polymorphism\"\n		\"Repeat\"\n		\"Secreted\"\n		\"Signal\")\n	(name \"GSN\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"GELS_HUMAN\"\n		\"Q8WVV7\")\n	(sequenceLength 782)\n	(species [GK_48887]))\n\n([GK_56134] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:Q99878 HIST1H2AJ recommendedName: Histone H2A type 1-J  alternativeName: Histone H2A/e \")\n	(checksum \"1\")\n	(comment \"FUNCTION Core component of nucleosome. Nucleosomes wrap and compact DNA into chromatin, limiting DNA accessibility to the cellular machineries which require DNA as a template. Histones thereby play a central role in transcription regulation, DNA repair, DNA replication and chromosomal stability. DNA accessibility is regulated via a complex set of post-translational modifications of histones, also called histone code, and nucleosome remodeling.SUBUNIT The nucleosome is a histone octamer containing two molecules each of H2A, H2B, H3 and H4 assembled in one H3-H4 heterotetramer and two H2A-H2B heterodimers. The octamer wraps approximately 147 bp of DNA.PTM Deiminated on Arg-4 in granulocytes upon calcium entry.PTM Phosphorylation on Ser-2 is enhanced during mitosis. Phosphorylation on Ser-2 by RPS6KA5/MSK1 directly represses transcription. Acetylation of H3 inhibits Ser-2 phosphorylation by RPS6KA5/MSK1.SIMILARITY Belongs to the histone H2A family.\")\n	(DB_ID 56134)\n	(description \"recommendedName: Histone H2A type 1-J  alternativeName: Histone H2A/e \")\n	(geneName\n		\"HIST1H2AJ\"\n		\"H2AFE\")\n	(identifier \"Q99878\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"Acetylation\"\n		\"Ch