displayName \"[Hsa] UniProt:P16104 H2AFX recommendedName: Histone H2A.x shortName:H2a/x \")\n	(checksum \"1\")\n	(comment \"DEVELOPMENTAL STAGE Synthesized in G1 as well as in S-phase.DOMAIN The [ST]-Q motif constitutes a recognition sequence for kinases from the PI3/PI4-kinase family.PTM Monoubiquitination of Lys-120 (H2AXK119ub) by RING1 and RNF2/RING2 complex gives a specific tag for epigenetic transcriptional repression. Following DNA double-strand breaks (DSBs), it is ubiquitinated through \'Lys-63\' linkage of ubiquitin moieties by the E2 ligase UBE2N and the E3 ligases RNF8 and RNF168, leading to the recruitment of repair proteins to sites of DNA damage. Monoubiquitination and ionizing radiation-induced \'Lys-63\'-linked ubiquitination are distinct events.SIMILARITY Belongs to the histone H2A family.\")\n	(DB_ID 56152)\n	(description \"recommendedName: Histone H2A.x shortName:H2a/x \")\n	(geneName\n		\"H2AFX\"\n		\"H2AX\")\n	(identifier \"P16104\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Acetylation\"\n		\"Cell cycle\"\n		\"Chromosome\"\n		\"Complete proteome\"\n		\"DNA damage\"\n		\"DNA recombination\"\n		\"DNA repair\"\n		\"DNA-binding\"\n		\"Isopeptide bond\"\n		\"Meiosis\"\n		\"Nucleosome core\"\n		\"Nucleus\"\n		\"Phosphoprotein\"\n		\"Ubl conjugation\")\n	(name \"H2AFX\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"H2AX_HUMAN\"\n		\"Q4ZGJ7\"\n		\"Q6IAS5\")\n	(sequenceLength 143)\n	(species [GK_48887]))\n\n([GK_56164] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P62807 HIST1H2BC recommendedName: Histone H2B type 1-C/E/F/G/I  alternativeName: Histone H2B.1 A  alternativeName: Histone H2B.a shortName:H2B/a  alternativeName: Histone H2B.a shortName:H2B/a  alternativeName: Histone H2B.g shortName:H2B/g  alternativeName: Histone H2B.g shortName:H2B/g  alternativeName: Histone H2B.h shortName:H2B/h  alternativeName: Histone H2B.h shortName:H2B/h  alternativeName: Histone H2B.k shortName:H2B/k  alternativeName: 