sulinoma amyloid peptide \")\n	(geneName \"IAPP\")\n	(identifier \"P10997\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Amidation\"\n		\"Amyloid\"\n		\"Cleavage on pair of basic residues\"\n		\"Complete proteome\"\n		\"Direct protein sequencing\"\n		\"Disulfide bond\"\n		\"Hormone\"\n		\"Polymorphism\"\n		\"Secreted\"\n		\"Signal\")\n	(name \"IAPP\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"IAPP_HUMAN\"\n		\"Q0ZD87\"\n		\"Q14598\")\n	(sequenceLength 89)\n	(species [GK_48887]))\n\n([GK_57031] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] CASP8(1-479) [cytosol]\")\n	(compartment [GK_70101])\n	(DB_ID 57031)\n	(endCoordinate 479)\n	(name\n		\"CASP8(1-479)\"\n		\"Caspase-8 precursor \"\n		\"ICE-like apoptotic protease 5\"\n		\"MORT1-associated CED-3 homolog\"\n		\"MACH\"\n		\"FADD-homologous ICE/CED-3- like protease\"\n		\"FADD-like ICE\"\n		\"FLICE\"\n		\"Apoptotic cysteine protease\"\n		\"Apoptotic protease Mch-5\"\n		\"CAP4\")\n	(referenceEntity [GK_57032])\n	(species [GK_48887])\n	(stableIdentifier [GK_362980])\n	(startCoordinate 1))\n\n([GK_57032] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:Q14790 CASP8 recommendedName: Caspase-8 shortName:CASP-8 ecNumber3.4.22.61/ecNumber  alternativeName: Apoptotic cysteine protease  alternativeName: Apoptotic protease Mch-5  alternativeName: CAP4  alternativeName: FADD-homologous ICE/ced-3-like protease  alternativeName: FADD-like ICE shortName:FLICE  alternativeName: ICE-like apoptotic protease 5  alternativeName: MORT1-associated ced-3 homolog shortName:MACH  component recommendedName: Caspase-8 subunit p18  /component component recommendedName: Caspase-8 subunit p10  /component\")\n	(checksum \"7A5FEAA6B39B582F\")\n	(comment \"FUNCTION Most upstream protease of the activation cascade of caspases responsible for the TNFRSF6/FAS mediated and TNFRSF1A induced cell death. Binding to the adapter molecule FADD recruits it to either receptor. The resulting aggregate called death-inducing signaling complex (DISC) performs CASP8 proteolytic activation. The active dimeric enzyme is then liberated from the DISC and free to activate downstream apoptotic proteases. Proteolytic fragments of the N-terminal propeptide (termed CAP3, CAP5 and CAP6) are likely retained in the DISC. Cleaves and activates CASP3, CASP4, CASP6, CASP7, CASP9 and CASP10. May participate in the GZMB apoptotic pathways. Cleaves ADPRT. Hydrolyzes the small-molecule substrate, Ac-Asp-Glu-Val-Asp-|-AMC. Likely target for the cowpox virus CRMA death inhibitory protein. Isoform 5, isoform 6, isoform 7 and isoform 8 lack the catalytic site and may interfere with the pro-apoptotic activity of the complex.CATALYTIC ACTIVITY Strict requirement for Asp at position P1 and has a preferred cleavage sequence of (Leu/Asp/Val)-Glu-Thr-Asp-|-(Gly/Ser/Ala).ENZYME REGULATION Inhibited by the effector protein NleF that is produced by pathogenic E.coli; this inhibits apoptosis.SUBUNIT Heterotetramer that consists of two anti-parallel arranged heterodimers, each one formed by a 18 kDa (p18) and a 10 kDa (p10) subunit. Interacts with FADD, CFLAR and PEA15. Isoform 9 interacts at the endoplasmic reticulum with a complex containing BCAP31, BAP29, BCL2 and/or BCL2L1. Interacts with TNFAIP8L2 (By similarity). Interacts with CASP8AP2. Interacts with human cytomegalovirus/HHV-5 protein vICA/UL36; this interaction inhibits CASP8 activation. Interacts with NleF from pathogenic E.coli.TISSUE SPECIFICITY Isoform 1, isoform 5 and isoform 7 are expressed in a wide variety of tissues. Highest expression in peripheral blood leukocytes, spleen, thymus and liver. Barely detectable in brain, testis and skeletal muscle.DOMAIN Isoform 9 contains a N-terminal extension that is required for interaction with the BCAP31 complex.PTM Generation of the subunits requires association with the death-inducing signaling complex (DISC), whereas additional processing is likely due to the autocatalytic activity of the activated protease. GZMB and CASP10 can be involved in these processing events.PTM Phosphorylation on Ser-387 during mitosis by CDK1 inhibits activation by proteolysis and prevents apoptosis. This phosphorylation occurs in cancer cell lines, as well as in primary breast tissues and lymphocytes.POLYMORPHISM Genetic variations in CASP8 are associated with reduced risk of lung cancer [MIM:211980] in a population of Han Chinese subjects. Genetic variations are also associated with decreased risk of cancer of various other forms including esophageal, gastric, colorectal, cervical, and breast, acting in an allele dose-dependent manner.SIMILARITY Belongs to the peptidase C14A family.SIMILARITY Contains 2 DED (death effector) domains.\")\n	(DB_ID 57032)\n	(description \"recommendedName: Caspase-8 shortName:CASP-8 ecNumber3.4.22.61/ecNumber  alternativeName: Apoptotic cysteine protease  alternativeName: Apoptotic protease Mch-5  alternativeName: CAP4  alternativeName: FADD-homologous ICE/ced-3-like protease  alternativeName: FADD-like ICE shortName:FLICE  alternativeName: ICE-like apoptotic protease 5  alternativeName: MORT1-associated ced-3 homolog shortName:MACH  component recommendedName: Caspase-8 subunit p18  /component component recommendedName: Caspase-8 subunit p10  /component\")\n	(geneName\n		\"CASP8\"\n		\"MCH5\")\n	(identifier \"Q14790\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Apoptosis\"\n		\"Complete proteome\"\n		\"Cytoplasm\"\n		\"Direct protein sequencing\"\n		\"Disease mutation\"\n		\"Host-virus interaction\"\n		\"Hydrolase\"\n		\"Phosphoprotein\"\n		\"Polymorphism\"\n		\"Protease\"\n		\"Reference proteome\"\n		\"Repeat\"\n		\"Thiol protease\"\n		\"Zymogen\")\n	(name \"CASP8\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"CASP8_HUMAN\"\n		\"O14676\"\n		\"Q14791\"\n		\"Q14792\"\n		\"Q14793\"\n		\"Q14794\"\n		\"Q14795\"\n		\"Q14796\"\n		\"Q15780\"\n		\"Q15806\"\n		\"Q53TT5\"\n		\"Q8TDI1\"\n		\"Q8TDI2\"\n		\"Q8TDI3\"\n		\"Q8TDI4\"\n		\"Q8TDI5\"\n		\"Q96T22\"\n		\"Q9C0K4\"\n		\"Q9UQ81\")\n	(sequenceLength 479)\n	(species [GK_48887]))\n\n([GK_57035] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] CASP10(220-415) [plasma membrane]\")\n	(compartment [GK_876])\n	(DB_ID 57035)\n	(endCoordinate 415)\n	(name\n		\"CASP10(220-415)\"\n		\"Caspase-10 precursor \"\n		\"ICE-like apoptotic protease 4\"\n		\"Apoptotic protease Mch-4\"\n		\"FAS-associated death domain protein interleukin-1B-converting enzyme 2\"\n		\"FLICE2\")\n	(referenceEntity [GK_57036])\n	(species [GK_48887])\n	(stableIdentifier [GK_370163])\n	(startCoordinate 220))\n\n([GK_57036] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:Q92851 CASP10 recommendedName: Caspase-10 shortName:CASP-10 ecNumber3.4.22.63/ecNumber  alternativeName: Apoptotic protease Mch-4  alternativeName: FAS-associated death domain protein interleukin-1B-converting enzyme 2 shortName:FLICE2  alternativeName: ICE-like apoptotic protease 4  component recommendedName: Caspase-10 subunit p23/17  /component component recommendedName: Caspase-10 subunit p12  /component\")\n	(checksum \"840348AE602B8243\")\n	(comment \"FUNCTION Involved in the activation cascade of caspases responsible for apoptosis execution. Recruited to both Fas- and TNFR-1 receptors in a FADD dependent manner. May participate in the granzyme B apoptotic pathways. Cleaves and activates caspase-3, -4, -6, -7, -8, and -9. Hydrolyzes the small- molecule substrates, Tyr-Val-Ala-Asp-|-AMC and Asp-Glu-Val-Asp-|-AMC.FUNCTION Isoform C is proteolytically inactive.CATALYTIC ACTIVITY Strict requirement for Asp at position P1 and has a preferred cleavage sequence of Leu-Gln-Thr-Asp-|-Gly.SUBUNIT Heterotetramer that consists of two anti-parallel arranged heterodimers, each one formed by a 23/17 kDa (p23/17) (depending on the splicing events) and a 12 kDa (p12) subunit (By similarity). Self-associates. Interacts with FADD and CASP8. Found in a Fas signaling complex consisting of FAS, FADD, CASP8 and CASP10.TISSUE SPECIFICITY Detectable in most tissues. Lowest expression is seen in brain, kidney, prostate, testis and colon.PTM Cleavage by granzyme B and autocatalytic activity generate the two active subunits.SIMILARITY Belongs to the peptidase C14A family.SIMILARITY Contains 2 DED (death effector) domains.\")\n	(DB_ID 57036)\n	(description \"recommendedName: Caspase-10 shortName:CASP-10 ecNumber3.4.22.63/ecNumber  alternativeName: Apoptotic protease Mch-4  alternativeName: FAS-associated death domain protein interleukin-1B-converting enzyme 2 shortName:FLICE2  alternativeName: ICE-like apoptotic protease 4  component recommendedName: Caspase-10 subunit p23/17  /component component recommendedName: Caspase-10 subunit p12  /component\")\n	(geneName\n		\"CASP10\"\n		\"MCH4\")\n	(identifier \"Q92851\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"Alternative splicing\"\n		\"Apoptosis\"\n		\"Complete proteome\"\n		\"Direct protein sequencing\"\n		\"Disease mutation\"\n		\"Hydrolase\"\n		\"Polymorphism\"\n		\"Protease\"\n		\"Reference proteome\"\n		\"Repeat\"\n		\"Thiol protease\"\n		\"Zymogen\")\n	(name \"CASP10\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"CASPA_HUMAN\"\n		\"Q68HC0\"\n		\"Q6KF62\"\n		\"Q6KF63\"\n		\"Q8IUP5\"\n		\"Q8WYQ8\"\n		\"Q99845\"\n		\"Q9Y2U6\"\n		\"Q9Y2U7\")\n	(sequenceLength 521)\n	(species [GK_48887]))\n\n([GK_571213] of  Person\n\n	(_displayName \"Zhou, H\")\n	(DB_ID 571213)\n	(firstname \"Huaijun\")\n	(initial \"H\")\n	(surname \"Zhou\"))\n\n([GK_57415] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P01308 INS recommendedName: Insulin  component recommendedName: Insulin B chain  /component component recommendedName: Insulin A chain  /component\")\n	(checksum \"1\")\n	(comment \"FUNCTION Insulin decreases blood glucose concentration. It increases cell permeability to monosaccharides, amino acids and fatty acids. It accelerates glycolysis, the pentose phosphate cycle, and glycogen synthesis in liver.SUBUNIT Heterodimer of a B chain and an A chain linked by two disulfide bonds.PHARMACEUTICAL Available under the names Humulin or Humalog (Eli Lilly) and Novolin (Novo Nordisk). Used in the treatment of diabetes. Humalog is an insulin analog with 52-Lys-Pro-53 instead of 52-Pro-Lys-53.SIMILARITY Belongs to the insulin family.\")\n	(DB_ID 57415)\n	(description \"recommendedName: Insulin  component recommendedName: Insulin B chain  /component component recommendedName: Insulin A chain  /component\")\n	(geneName \"INS\")\n	(identifier \"P01308\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Carbohydrate metabolism\"\n		\"Cleavage on pair of basic residues\"\n		\"Complete proteome\"\n		\"Diabetes mellitus\"\n		\"Direct protein sequencing\"\n		\"Disease mutation\"\n		\"Disulfide bond\"\n		\"Glucose metabolism\"\n		\"Hormone\"\n		\"Pharmaceutical\"\n		\"Polymorphism\"\n		\"Secreted\"\n		\"Signal\")\n	(name \"INS\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"INS_HUMAN\"\n		\"Q5EEX2\")\n	(sequenceLength 110)\n	(species [GK_48887]))\n\n([GK_57627] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:Q9Y287 ITM2B recommendedName: Integral membrane protein 2B  alternativeName: Protein E25B  alternativeName: Transmembrane protein BRI  component recommendedName: ABri/ADan amyloid peptide  /component\")\n	(checksum \"1\")\n	(comment \"TISSUE SPECIFICITY Expressed in brain and in other tissues.DISEASE Defects in ITM2B are a cause of cerebral amyloid angiopathy ITM2B-related type 2 (CAA-ITM2B2) [MIM:117300]; also known as heredopathia ophthalmo-oto-encephalica. A disorder characterized by amyloid deposition in the walls of the blood vessels of the cerebrum, choroid plexus, cerebellum, spinal cord and retina. Plaques and neurofibrillary tangles are observed in the hippocampus. Clinical features include progressive ataxia, dementia, cataracts and deafness.SIMILARITY Belongs to the ITM2 family.SIMILARITY Contains 1 BRICHOS domain