Name: SPPL2A-processed FasL form shortName:SPA  /component\")\n	(checksum \"A8A6EB358246E9BB\")\n	(comment \"FUNCTION Cytokine that binds to TNFRSF6/FAS, a receptor that transduces the apoptotic signal into cells. May be involved in cytotoxic T-cell mediated apoptosis and in T-cell development. TNFRSF6/FAS-mediated apoptosis may have a role in the induction of peripheral tolerance, in the antigen-stimulated suicide of mature T-cells, or both. Binding to the decoy receptor TNFRSF6B/DcR3 modulates its effects.FUNCTION The FasL intracellular domain (FasL ICD) cytoplasmic form induces gene transcription inhibition.SUBUNIT Homotrimer (Probable). Interacts with ARHGAP9, BAIAP2L1, BTK, CACNB3, CACNB4, CRK, DLG2, DNMBP, DOCK4, EPS8L3, FGR, FYB, FYN, HCK, ITK, ITSN2, KALRN, LYN, MACC1, MIA, MPP4, MYO15A, NCF1, NCK1, NCK2, NCKIPSD, OSTF1, PIK3R1, PSTPIP1, RIMBP3C, SAMSN1, SH3GL3, SH3PXD2B, SH3PXD2A, SH3RF2, SKAP2, SNX33, SNX9, SORBS3, SPTA1, SRC, SRGAP1, SRGAP2, SRGAP3, TEC, TJP3 and YES1.PTM The soluble form derives from the membrane form by proteolytic processing. The membrane-bound form undergoes two successive intramembrane proteolytic cleavages. The first one is processed by ADAM10 producing an N-terminal fragment, which lacks the receptor-binding extracellular domain. This ADAM10-processed FasL (FasL APL) remnant form is still membrane anchored and further processed by SPPL2A that liberates the FasL intracellular domain (FasL ICD). FasL shedding by ADAM10 is a prerequisite for subsequent intramembrane cleavage by SPPL2A in T-cells.PTM N-glycosylated.PTM Phosphorylated by FGR on tyrosine residues; this is required for ubiquitination and subsequent internalization.PTM Monoubiquitinated.SIMILARITY Belongs to the tumor necrosis factor family.\")\n	(DB_ID 66213)\n	(description \"recommendedName: Tumor necrosis factor ligand superfamily member 6  alternativeName: Apoptosis antigen ligand shortName:APTL  alternativeName: CD95 ligand shortName:CD95-L  alternativeName: Fas antigen ligand shortName:Fas ligand shortName:FasL  cdAntigenNameCD178/cdAntigenName component recommendedName: Tumor necrosis factor ligand superfamily member 6, membrane form  /component component recommendedName: Tumor necrosis factor ligand superfamily member 6, soluble form  alternativeName: Receptor-binding FasL ectodomain  alternativeName: Soluble Fas ligand shortName:sFasL  /component component recommendedName: ADAM10-processed FasL form shortName:APL  /component component recommendedName: FasL intracellular domain shortName:FasL ICD  alternativeName: SPPL2A-processed FasL form shortName:SPA  /component\")\n	(geneName\n		\"FASLG\"\n		\"APT1LG1\"\n		\"CD95L\"\n		\"FASL\"\n		\"TNFSF6\")\n	(identifier \"P48023\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Apoptosis\"\n		\"Cell membrane\"\n		\"Complete proteome\"\n		\"Cytokine\"\n		\"Cytoplasmic vesicle\"\n		\"Disulfide bond\"\n		\"Glycoprotein\"\n		\"Lysosome\"\n		\"Membrane\"\n		\"Nucleus\"\n		\"Polymorphism\"\n		\"Reference proteome\"\n		\"Repressor\"\n		\"Secreted\"\n		\"Signal-anchor\"\n		\"Transcription\"\n		\"Transcription regulation\"\n		\"Transmembrane\"\n		\"Transmembrane helix\"\n		\"Ubl conjugation\")\n	(name \"FASLG\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TNFL6_HUMAN\"\n		\"Q9BZP9\")\n	(sequenceLength 281)\n	(species [GK_48887]))\n\n([GK_66220] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] TNF(1-233) [plasma membrane]\")\n	(compartment [GK_876])\n	(DB_ID 66220)\n	(endCoordinate 233)\n	(name\n		\"TNF(1-233)\"\n		\"TNF-alpha\"\n		\"Tumor necrosis factor precursor (TNF-alpha) (Tumor necrosis factor ligand superfamily member 2) (Cachectin)\"\n		\"Tumor necrosis factor precursor\"\n		\"Tumor necrosis factor ligand superfamily member 2\"\n		\"TNF-a\"\n		\"Cachectin\")\n	(referenceEntity [GK_66221])\n	(species [GK_48887])\n	(stableIdentifier [GK_370748])\n	(startCoordinate 1))\n\n([GK_66221] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P01375 TNF recommendedName: Tumor necrosis factor  alternativeName: Cachectin  alternativeName: TNF-alpha  alternativeName: Tumor necrosis factor ligand superfamily member 2 shortName:TNF-a  component recommendedName: Tumor necrosis factor, membrane form  alternativeName: N-terminal fragment shortName:NTF  /component component recommendedName: Intracellular domain 1 shortName:ICD1  /component component recommendedName: Intracellular domain 2 shortName:ICD2  /component component recommendedName: C-domain 1  /component component recommendedName: C-domain 2  /component component recommendedName: Tumor necrosis factor, soluble form  /component\")\n	(checksum \"3DF90F96C9031FFE\")\n	(comment \"FUNCTION Cytokine that binds to TNFRSF1A/TNFR1 and TNFRSF1B/TNFBR. It is mainly secreted by macrophages and can induce cell death of certain tumor cell lines. It is potent pyrogen causing fever by direct action or by stimulation of interleukin-1 secretion and is implicated in the induction of cachexia, Under certain conditions it can stimulate cell proliferation and induce cell differentiation.FUNCTION The TNF intracellular domain (ICD) form induces IL12 production in dendritic cells.SUBUNIT Homotrimer. Interacts with SPPL2B.PTM The soluble form derives from the membrane form by proteolytic processing. The membrane-bound form is further proteolytically processed by SPPL2A or SPPL2B through regulated intramembrane proteolysis producing TNF intracellular domains (ICD1 and ICD2) released in the cytosol and TNF C-domain 1 and C-domain 2 secreted into the extracellular space.PTM The membrane form, but not the soluble form, is phosphorylated on serine residues. Dephosphorylation of the membrane form occurs by binding to soluble TNFRSF1A/TNFR1.PTM O-glycosylated; glycans contain galactose, N-acetylgalactosamine and N-acetylneuraminic acid.POLYMORPHISM Genetic variations in TNF influence susceptibility to hepatitis B virus (HBV) infection [MIM:610424].POLYMORPHISM Genetic variations in TNF are involved in susceptibility to malaria [MIM:611162].SIMILARITY Belongs to the tumor necrosis factor family.\")\n	(DB_ID 66221)\n	(description \"recommendedName: Tumor necrosis factor  alternativeName: Cachectin  alternativeName: TNF-alpha  alternativeName: Tumor necrosis factor ligand superfamily member 2 shortName:TNF-a  component recommendedName: Tumor necrosis factor, membrane form  alternativeName: N-terminal fragment shortName:NTF  /component component recommendedName: Intracellular domain 1 shortName:ICD1  /component component recommendedName: Intracellular domain 2 shortName:ICD2  /component component recommendedName: C-domain 1  /component component recommendedName: C-domain 2  /component component recommendedName: Tumor necrosis factor, soluble form  /component\")\n	(geneName\n		\"TNF\"\n		\"TNFA\"\n		\"TNFSF2\")\n	(identifier \"P01375\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Cell membrane\"\n		\"Complete proteome\"\n		\"Cytokine\"\n		\"Direct protein sequencing\"\n		\"Disulfide bond\"\n		\"Glycoprotein\"\n		\"Lipoprotein\"\n		\"Membrane\"\n		\"Myristate\"\n		\"Phosphoprotein\"\n		\"Polymorphism\"\n		\"Reference proteome\"\n		\"Secreted\"\n		\"Signal-anchor\"\n		\"Transmembrane\"\n		\"Transmembrane helix\")\n	(name \"TNF\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TNFA_HUMAN\"\n		\"O43647\"\n		\"Q9P1Q2\"\n		\"Q9UIV3\")\n	(sequenceLength 233)\n	(species [GK_48887]))\n\n([GK_66248] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] FAS [plasma membrane]\")\n	(compartment [GK_876])\n	(DB_ID 66248)\n	(endCoordinate 335)\n	(name\n		\"FAS\"\n		\"FAS Receptor\"\n		\"Tumor necrosis factor receptor superfamily member 6 precursor (FASL receptor) (Apoptosis-mediating surface antigen FAS) (Apo-1 antigen) (CD95)\"\n		\"Tumor necrosis factor receptor superfamily member 6 precursor\"\n		\"FASL receptor\"\n		\"Apoptosis-mediating surface antigen FAS\"\n		\"Apo-1 antigen\"\n		\"CD95\")\n	(referenceEntity [GK_66249])\n	(species [GK_48887])\n	(stableIdentifier [GK_364006])\n	(startCoordinate 26))\n\n([GK_66249] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P25445 FAS recommendedName: Tumor necrosis factor receptor superfamily member 6  alternativeName: Apo-1 antigen  alternativeName: Apoptosis-mediating surface antigen FAS  alternativeName: FASLG receptor  cdAntigenNameCD95/cdAntigenName\")\n	(checksum \"0139942535111410\")\n	(comment \"FUNCTION Receptor for TNFSF6/FASLG. The adapter molecule FADD recruits caspase-8 to the activated receptor. The resulting death-inducing signaling complex (DISC) performs caspase-8 proteolytic activation which initiates the subsequent cascade of caspases (aspartate-specific cysteine proteases) mediating apoptosis. FAS-mediated apoptosis may have a role in the induction of peripheral tolerance, in the antigen-stimulated suicide of mature T-cells, or both. The secreted isoforms 2 to 6 block apoptosis (in vitro).SUBUNIT Binds DAXX. Interacts with HIPK3. Part of a complex containing HIPK3 and FADD (By similarity). Binds RIPK1 and FAIM2. Interacts with BRE and FEM1B. Interacts with FADD.TISSUE SPECIFICITY Isoform 1 and isoform 6 are expressed at equal levels in resting peripheral blood mononuclear cells. After activation there is an increase in isoform 1 and decrease in the levels of isoform 6.DOMAIN Contains a death domain involved in the binding of FADD, and maybe to other cytosolic adapter proteins.PTM N- and O-glycosylated. O-glycosylated with core 1 or possibly core 8 glycans.SIMILARITY Contains 1 death domain.SIMILARITY Contains 3 TNFR-Cys repeats.\")\n	(DB_ID 66249)\n	(description \"recommendedName: Tumor necrosis factor receptor superfamily member 6  alternativeName: Apo-1 antigen  alternativeName: Apoptosis-mediating surface antigen FAS  alternativeName: FASLG receptor  cdAntigenNameCD95/cdAntigenName\")\n	(geneName\n		\"FAS\"\n		\"APT1\"\n		\"FAS1\"\n		\"TNFRSF6\")\n	(identifier \"P25445\")\n	(isSequenceChanged 