sum \"4CEFBA96D03B8225\")\n	(comment \"FUNCTION Receptor for TNFSF2/TNF-alpha and homotrimeric TNFSF1/lymphotoxin-alpha. The adapter molecule FADD recruits caspase-8 to the activated receptor. The resulting death-inducing signaling complex (DISC) performs caspase-8 proteolytic activation which initiates the subsequent cascade of caspases (aspartate-specific cysteine proteases) mediating apoptosis. Contributes to the induction of non-cytocidal TNF effects including anti-viral state and activation of the acid sphingomyelinase.SUBUNIT Binding of TNF to the extracellular domain leads to homotrimerization. The aggregated death domains provide a novel molecular interface that interacts specifically with the death domain of TRADD. Various TRADD-interacting proteins such as TRAFS, RIPK1 and possibly FADD, are recruited to the complex by their association with TRADD. This complex activates at least two distinct signaling cascades, apoptosis and NF-kappa-B signaling. Interacts with BAG4, BRE, FEM1B, GRB2, SQSTM1 and TRPC4AP. Interacts with HCV core protein. Interacts with human cytomegalovirus/HHV-5 protein UL138.DOMAIN The domain that induces A-SMASE is probably identical to the death domain. The N-SMASE activation domain (NSD) is both necessary and sufficient for activation of N-SMASE.PTM The soluble form is produced from the membrane form by proteolytic processing.SIMILARITY Contains 1 death domain.SIMILARITY Contains 4 TNFR-Cys repeats.\")\n	(DB_ID 66345)\n	(description \"recommendedName: Tumor necrosis factor receptor superfamily member 1A  alternativeName: Tumor necrosis factor receptor 1 shortName:TNF-R1  alternativeName: Tumor necrosis factor receptor type I shortName:TNF-RI shortName:TNFR-I  alternativeName: p55  alternativeName: p60  cdAntigenNameCD120a/cdAntigenName component recommendedName: Tumor necrosis factor receptor superfamily member 1A, membrane form  /component component recommendedName: Tumor necrosis factor-binding protein 1 shortName:TBPI  /component\")\n	(geneName\n		\"TNFRSF1A\"\n		\"TNFAR\"\n		\"TNFR1\")\n	(identifier \"P19438\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Amyloidosis\"\n		\"Apoptosis\"\n		\"Cell membrane\"\n		\"Cleavage on pair of basic residues\"\n		\"Complete proteome\"\n		\"Direct protein sequencing\"\n		\"Disease mutation\"\n		\"Disulfide bond\"\n		\"Glycoprotein\"\n		\"Golgi apparatus\"\n		\"Host-virus interaction\"\n		\"Membrane\"\n		\"Polymorphism\"\n		\"Receptor\"\n		\"Reference proteome\"\n		\"Repeat\"\n		\"Secreted\"\n		\"Signal\"\n		\"Transmembrane\"\n		\"Transmembrane helix\")\n	(name \"TNFRSF1A\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TNR1A_HUMAN\"\n		\"A8K4X3\"\n		\"B2RDE4\"\n		\"B3KPQ1\"\n		\"B4DQB7\"\n		\"B4E309\"\n		\"B5M0B5\"\n		\"D3DUR1\"\n		\"Q9UCA4\")\n	(sequenceLength 455)\n	(species [GK_48887]))\n\n([GK_66370] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] TRAF2 [cytosol]\")\n	(compartment [GK_70101])\n	(DB_ID 66370)\n	(endCoordinate 501)\n	(name\n		\"TRAF2\"\n		\"TNF receptor associated factor 2\"\n		\"Tumor necrosis factor type 2 receptor associated protein 3\")\n	(referenceEntity [GK_66371])\n	(species [GK_48887])\n	(stableIdentifier [GK_369343])\n	(startCoordinate 2))\n\n([GK_66371] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:Q12933 TRAF2 recommendedName: TNF receptor-associated factor 2 ecNumber6.3.2.-/ecNumber  alternativeName: E3 ubiquitin-protein ligase TRAF2  alternativeName: Tumor necrosis factor type 2 receptor-associated protein 3 \")\n	(checksum \"C508BE185B783B20\")\n	(comment \"FUNCTION Regulates activation of NF-kappa-B and JNK and plays a central role in the regulation of cell survival and apoptosis. Required for normal antibody isotype switching from IgM to IgG. Has E3 ubiquitin-protein ligase activity and promotes \'Lys-63\'-linked ubiquitination of target proteins, such as BIRC3, RIPK1 and TICAM1. Is an essential constituent of several E3 ubiquitin-protein ligase complexes, where it promotes the ubiquitination of target proteins by bringing them into contact with other E3 ubiquitin ligases. Regulates BIRC2 and BIRC3 protein levels by inhibiting their autoubiquitination and subsequent degradation; this does not depend on the TRAF2 RING-type zinc finger domain. Plays a role in mediating activation of NF-kappa-B by EIF2AK2/PKR.ENZYME REGULATION Has very low E3 ubiquitin ligase activity in the absence of sphingosine-1-phosphate. E3 ubiquitin ligase activity is strongly activated by cytoplasmic sphingosine-1-phosphate.PATHWAY Protein modification; protein ubiquitination.SUBUNIT Homotrimer, and heterotrimer with TRAF1 and TRAF3 (via TRAF domain). The domain containing the RING-type and the first TRAF-type zinc finger can also form homodimers (in vitro). Interacts with TNFRSF1B/TNFR2, TNFRSF4, TNFRSF5/CD40, CD27/TNFRSF7, TNFRSF8/CD30, TNFRSF9/CD137, TNFRSF11A/RANK, TNFRSF13B/TACI, TNFRSF14, TNFRSF16/NGFR, TNFRSF17/BCMA, TNFRSF18/AITR, TNFRSF19/TROY, TNFRSF19L/RELT, XEDAR, EDAR, Epstein-Barr virus BNFL1/LMP-1 and IL15RA. Interacts with CDK9, CSK, MAP3K1, MAP3K5, MAP3K11, MAP3K14, MAP4K2, RIPK1, RIPK2, TNIK, TBK1, SPHK1, TRADD, TRAFD1, TRAIP, TANK/ITRAF, TNFAIP3, TDP2, MAVS/IPS1, TICAM1 and TRPC4AP. Interacts with CASP8AP2, NFATC2IP, PEG3 and HIVEP3. Interacts with ERN1; the interaction requires DAB2IP (By similarity). Interacts with BIRC2 and BIRC3 N-terminus; a single BIRC2 or BIRC3 molecule interacts with a heterotrimer formed by TRAF1 and TRAF2, or a TRAF2 homotrimer. Identified in a complex composed of TRAF2, TRAF3, BIRC2 and BIRC3. Interaction with BIRC2 and/or BIRC3 is essential for degradation of NFKBIA and activation of NF-kappa-B. Interacts with CYLD, USP48, IKKA and IKKB. Identified in a complex with TNFRSF1A, RIPK1 and IKKB. Interacts (via \'Lys-63\'-linked polyubiquitin chains) with TAB2 and TAB3. Interacts with ERN1 and TAOK3. Interaction with TAOK3 is facilitated under ER stress conditions, such as treatment with tunicamycin, and may promote TRAF2 phosphorylation. Interacts (via zinc fingers) with DAB2IP (via C-terminus PER domain); the interaction occurs in a TNF-alpha-dependent manner. Interacts (via C-terminus) with EIF2AK2/PKR (via the kinase catalytic domain). Interacts with CARD14. Interacts with PTPN2; probably involved in tumor necrosis factor-mediated signaling.DOMAIN The coiled coil domain mediates homo- and hetero-oligomerization.DOMAIN The MATH/TRAF domain binds to receptor cytoplasmic domains.DOMAIN The RING-type zinc finger domain is essential for E3 ubiquitin-protein ligase activity. It is not essential for the stabilization of BIRC2, or for the ubiquitination of RIPK1 in response to TNFR1 signaling.PTM Phosphorylated at several serine residues within the first 128 amino acid residues. Phosphorylated at Thr-117 in response to signaling via TNF and TNFRSF1A. Phosphorylation at Thr-117 is required for \'Lys-63\'-linked polyubiquitination, but not for \'Lys-48\'-linked polyubiquitination. Phosphorylation at Thr-117 is important for interaction with IKKA and IKKB, activation of IKK and subsequent activation of NF-kappa-B.PTM Undergoes both \'Lys-48\'-linked and \'Lys-63\'-linked polyubiquitination. Polyubiquitinated via \'Lys-63\'-linked ubiquitin in response to TNF signaling; this requires prior phosphorylation at Thr-117. \'Lys-63\'-linked polyubiquitination promotes TRAF2-mediated activation of NF-kappa-B. Can be polyubiquitinated at several Lys residues via \'Lys-48\'-linked ubiquitin chains in response to TNF signaling, leading to proteasomal degradation. Autoubiquitinated, leading to its subsequent proteasomal degradation. Polyubiquitinated by BIRC2 and SIAH2, leading to its subsequent proteasomal degradation. Deubiquitinated by CYLD, a protease that specifically cleaves \'Lys-63\'-linked polyubiquitin chains.SIMILARITY Belongs to the TNF receptor-associated factor family. A subfamily.SIMILARITY Contains 1 MATH domain.SIMILARITY Contains 1 RING-type zinc finger.SIMILARITY Contains 2 TRAF-type zinc fingers.\")\n	(DB_ID 66371)\n	(description \"recommendedName: TNF receptor-associated factor 2 ecNumber6.3.2.-/ecNumber  alternativeName: E3 ubiquitin-protein ligase TRAF2  alternativeName: Tumor necrosis factor type 2 receptor-associated protein 3 \")\n	(geneName\n		\"TRAF2\"\n		\"TRAP3\")\n	(identifier \"Q12933\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Acetylation\"\n		\"Alternative splicing\"\n		\"Apoptosis\"\n		\"Coiled coil\"\n		\"Complete proteome\"\n		\"Cytoplasm\"\n		\"Isopeptide bond\"\n		\"Ligase\"\n		\"Lipid-binding\"\n		\"Metal-binding\"\n		\"Phosphoprotein\"\n		\"Reference proteome\"\n		\"Repeat\"\n		\"Ubl conjugation\"\n		\"Ubl conjugation pathway\"\n		\"Zinc\"\n		\"Zinc-finger\")\n	(name \"TRAF2\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TRAF2_HUMAN\"\n		\"A8K107\"\n		\"B4DPJ7\"\n		\"Q7Z337\"\n		\"Q96NT2\")\n	(sequenceLength 501)\n	(species [GK_48887]))\n\n([GK_66376] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] TRADD [cytosol]\")\n	(compartment [GK_70101])\n	(DB_ID 66376)\n	(endCoordinate 312)\n	(name\n		\"TRADD\"\n		\"TNFR1-associated DEATH domain protein\"\n		\"Tumor necrosis factor receptor type 1 associated DEATH domain protein\"\n		\"TNFRSF1A-associated via death domain\")\n	(referenceEntity [GK_66377])\n	(species [GK_48887])\n	(stableIdentifier [GK_365494])\n	(startCoordinate 1))\n\n([GK_66377] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:Q15628 TRADD recommendedName: Tumor necrosis factor receptor type 1-associated DEATH domain protein shortName:TNFR1-associated DEATH domain protein  alternativeName: TNFRSF1A-associated via death domain \")\n	(checksum \"5645D7E63E5FF05A\")\n	(comment \"FUNCTION The nuclear form acts as a tumor suppressor by preventing ubiquitination and degradation of isoform p19ARF/ARF of CDKN2A by TRIP12: acts by interacting with TRIP12, leading to disrupt interaction between TRIP12 and isoform p19ARF/ARF of CDKN2A (By similarity). Adapter molecule for TNFRSF1A/TNFR1 that specifically associates with the cytoplasmic domain of activated TNFRSF1A/TNFR1 mediating its interaction with FADD. Overexpression of TRADD leads to two major TNF-induced responses, apoptosis and activation of NF-kappa-B.SUBUNIT Interacts with TRIP12 (By similarity). Heterodimer with TNFRSF1A/TNFR1. Interacts with DAB2IP, FADD, HIPK2, KRT14, KRT16, KRT17, KRT18, RIPK1, SQSTM1, TRAF1, TRAF2 and TRPC4AP.TISSUE SPECIFICITY Found in all examined tissues.DOMAIN Requires the intact death domain to associate with TNFRSF1A/TNFR1.SIMILARITY Contains 1 death domain.\")\n	(DB_ID 66377)\n	(description \"recommendedName: Tumor necrosis factor receptor type 1-associated DEATH domain protein shortName:TNFR1-associated DEATH domain protein  alternativeName: TNFRSF1A-associated via death domain \")\n	(geneName \"TRADD\")\n	(identifier \"Q15628\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Apoptosis\"\n		\"Complete proteome\"\n		\"Cytoplasm\"\n		\"Cytoskeleton\"\n		\"Nucleus\"\n		\"Reference proteome\")\n	(name \"TRADD\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TRADD_HUMAN\"\n		\"B2RDS3\"\n		\"Q52NZ1\")\n	(sequenceLength 312)\n	(species [GK_48887]))\n\n([GK_66401] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P02788 LTF  Lactotransferrin shortName:Lactoferrin  alternativeName: Talalactoferrin  component recommendedName: Kaliocin-1  /component component recommendedName: Lactoferroxin-A  /component component recommendedName: Lactoferroxin-B  /component component recommendedName: Lactoferroxin-C  /component\")\n	(checksum \"1\")\n	(comment \"CATALYTIC ACTIVITY Preferential at -Arg-Ser-Arg-Arg-|- and -Arg-Arg-Ser-Arg-|-, and of Z-Phe-Arg-|-aminomethylcoumarin.SUBUNIT Monomer.SIMILARITY Belongs to the transferrin family.SIMILARITY Contains 2 transferrin-like domains.\")\n	(DB_ID 66401)\n	(description \" Lactotransferrin shortName:Lactoferrin  alternativeName: Talalactoferrin  component recommendedName: Kaliocin-1  /component component recommendedName: Lactoferroxin-A  /component component recommendedName: Lactoferroxin-B  /component component recommendedName: Lactoferroxin-C  /component\")\n	(geneName\n		\"LTF\"\n		\"LF\")\n	(identifier \"P02788\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Antibiotic\"\n		\"Antimicrobial\"\n		\"Complete proteome\"\n		\"Direct protein sequencing\"\n		\"Disulfide bond\"\n		\"Glycoprotein\"\n		\"Hydrolase\"\n		\"Ion transport\"\n		\"Iron\"\n		\"Iron transport\"\n		\"Metal-binding\"\n		\"Phosphoprotein\"\n		\"Polymorphism\"\n		\"Protease\"\n		\"Repeat\"\n		\"Secreted\"\n		\"Serine protease\"\n		\"Signal\"\n		\"Transport\")\n	(name \"LTF\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TRFL_HUMAN\"\n		\"O00756\"\n		\"Q16780\"\n		\"Q16785\"\n		\"Q16786\"\n		\"Q16789\"\n		\"Q8IU92\"\n		\"Q8IZH6\"\n		\"Q8TCD2\"\n		\"Q96KZ4\"\n		\"Q96KZ5\"\n		\"Q9H1Z3\"\n		\"Q9UCY5\")\n	(sequenceLength 710)\n	(species [GK_48887]))\n\n([GK_66545] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P02766 TTR recommendedName: Transthyretin  alternativeName: ATTR  alternativeName: Prealbumin  alternativeName: TBPA \")\n	(checksum \"1\")\n	(comment \"DOMAIN Each monomer has two 4-stranded beta sheets and the shape of a prolate ellipsoid. Antiparallel beta-sheet interactions link monomers into dimers. A short loop from each monomer forms the main dimer-dimer interaction. These two pairs of loops separate the opposed, convex beta-sheets of the dimers to form an internal channel.MISCELLANEOUS Tetramer dissociation and partial unfolding leads to the formation of aggregates and amyloid fibrils. Small molecules that occupy at least one of the thyroid hormone binding sites stabilize the tetramer, and thereby stabilize the native state and protect against misfolding and the formation of amyloid fibrils.MISCELLANEOUS Two binding sites for thyroxine are located in the channel. Less than 1% of plasma prealbumin molecules are normally involved in thyroxine transport. L-thyroxine binds to the transthyretin by an order of magnitude stronger than does the triiodo-L-thyronine. Thyroxine-binding globulin is the major carrier protein for thyroid hormones in man.MISCELLANEOUS About 40% of plasma transthyretin circulates in a tight protein-protein complex with the plasma retinol-binding protein (RBP). The formation of the complex with RBP stabilizes the binding of retinol to RBP and decreases the glomerular filtration and renal catabolism of the relatively small RBP molecule. There is evidence for 2 binding sites for RBP, one possibly being a region that includes Ile-104, located on the outer surface of the transthyretin molecule.SIMILARITY Belongs to the transthyretin family.\")\n	(DB_ID 66545)\n	(description \"recommendedName: Transthyretin  alternativeName: ATTR  alternativeName: Prealbumin  alternativeName: TBPA \")\n	(geneName\n		\"TTR\"\n		\"PALB\")\n	(identifier \"P02766\")\n	(isSequenceChanged TRUE)\n	(keyword\n		\"3D-structure\"\n		\"Amyloid\"\n		\"Amyloidosis\"\n		\"Complete proteome\"\n		\"Cytoplasm\"\n		\"Direct protein sequencing\"\n		\"Disease mutation\"\n		\"Gamma-carboxyglutamic acid\"\n		\"Glycoprotein\"\n		\"Hormone\"\n		\"Neuropathy\"\n		\"Polymorphism\"\n		\"Secreted\"\n		\"Signal\"\n		\"Thyroid hormone\"\n		\"Transport\")\n	(name \"TTR\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TTHY_HUMAN\"\n		\"Q549C7\"\n		\"Q6IB96\"\n		\"Q9UBZ6\"\n		\"Q9UCM9\")\n	(sequenceLength 147)\n	(species [GK_48887]))\n\n([GK_69324] of  Affiliation\n\n	(_displayName \"NYU School of Medicine, Department of Biochemistry\")\n	(address \"New York NY USA\")\n	(DB_ID 69324)\n	(name \"NYU School of Medicine, Department of Biochemistry\"))\n\n([GK_69416] of  Pathway\n\n	(_displayName \"[Hsa] Dimerization of procaspase-8\")\n	(_doRelease TRUE)\n	(compartment [GK_356])\n	(DB_ID 69416)\n	(edited [GK_3508822])\n	(goBiologicalProcess [GK_23175])\n	(hasEvent\n		[GK_73945]\n		[GK_141156]\n		[GK_141159])\n	(literatureReference\n		[GK_1267800]\n		[GK_2584573]\n		[GK_2671825])\n	(name \"Dimerization of procaspase-8\")\n	(reviewed\n		[GK_2594924]\n		[GK_3597630])\n	(species [GK_48887])\n	(stableIdentifier [GK_358384])\n	(summation [GK_213104]))\n\n([GK_69781] of  ReferenceGeneProduct\n\n	(_displayName \"[Hsa] UniProt:P05067 APP recommendedName: Amyloid beta A4 protein  alternativeName: ABPP  alternativeName: APPI shortName:APP  alternativeName: APPI shortName:APP  alternativeName: Alzheimer disease amyloid protein  alternativeName: Cerebral vascular amyloid peptide shortName:CVAP  alternativeName: Cerebral vascular amyloid peptide shortName:CVAP  alternativeName: PreA4  alternativeName: Protease nexin-II shortName:PN-II  alternativeName: Protease nexin-II shortName:PN-II  component recommendedName: N-APP  /component component recommendedName: Soluble APP-alpha shortName:S-APP-alpha  /component component recommendedName: Soluble APP-beta shortName:S-APP-beta  /component component recommendedName: C99  /component component recommendedName: Beta-amyloid protein 42  alternativeName: Beta-APP42  /component component recommendedName: Beta-amyloid protein 40  alternativeName: Beta-APP40  /component component recommendedName: C83  /component component recommendedName: P3(42)  /component component recommendedName: P3(40)  /component component recommendedName: C80  /component component recommendedName: Gamma-secretase C-terminal fragment 59  alternativeName: Amyloid intracellular domain 59 shortName:AICD-59 shortName:AID(59)  alternativeName: Gamma-CTF(59)  /component component recommendedName: Gamma-secretase C-terminal fragment 57  alternativeName: Amyloid intracellular domain 57 shortName:AICD-57 shortName:AID(57)  alternativeName: Gamma-CTF(57)  /component component recommendedName: Gamma-secretase C-terminal fragment 50  alternativeName: Amyloid intracellular domain 50 shortName:AICD-50 shortName:AID(50)  alternativeName: Gamma-CTF(50)  /component component recommendedName: C31  /component\")\n	(checksum \"1\")\n	(comment \"INDUCTION Increased levels during neuronal differentiation.PTM Proteolytically processed under normal cellular conditions. Cleavage either by alpha-secretase, beta-secretase or theta-secretase leads to generation and extracellular release of soluble APP peptides, S-APP-alpha and S-APP-beta, and the retention of corresponding membrane-anchored C-terminal fragments, C80, C83 and C99. Subsequent processing of C80 and C83 by gamma-secretase yields P3 peptides. This is the major secretory pathway and is non-amyloidogenic. Alternatively, presenilin/nicastrin-mediated gamma-secretase processing of C99 releases the amyloid beta proteins, amyloid-beta 40 (Abeta40) and amyloid-beta 42 (Abeta42), major components of amyloid plaques, and the cytotoxic C-terminal fragments, gamma-CTF(50), gamma-CTF(57) and gamma-CTF(59).PTM Extracellular binding and reduction of copper, results in a corresponding oxidation of Cys-144 and Cys-158, and the formation of a disulfide bond. In vitro, the APP-Cu(+) complex in the presence of hydrogen peroxide results in an increased production of beta-amyloid-containing peptides.PTM Beta-amyloid peptides are degraded by IDE.MISCELLANEOUS Chelation of metal ions, notably copper, iron and zinc, can induce histidine-bridging between beta-amyloid molecules resulting in beta-amyloid-metal aggregates. The affinity for copper is much higher than for other transient metals and is increased under acidic conditions. Extracellular zinc-binding increases binding of heparin to APP and inhibits collagen-binding.SIMILARITY Belongs to the APP family.SIMILARITY Contains 1 BPTI/Kunitz inhibitor domain.\")\n	(DB_ID 69781)\n	(description \"recommendedName: Amyloid beta A4 protein  alternativeName: ABPP  alternativeName: APPI shortName:APP  alternativeName: APPI shortName:APP  alternativeName: Alzheimer disease amyloid protein  alternativeName: Cerebral vascular amyloid peptide shortName:CVAP  al